INSERT INTO mod_albums (`ID`, `user_id`, `imenu`, `the_code`, `mod_display`, `mod_vote`, `mod_comment`, `tieu_de`, `en_tieu_de`, `description`, `en_description`, `keywords`, `thoi_gian`, `thoi_gian_end`, `thoi_gian_update`, `vote`, `vote_times`, `viewed_times`) VALUES (1, '1', '32', '', 1, 1, 1, 'Áo cưới đẹp lộng lẫy', '', ' Taị Ely chúng tôi hiêu rằng,trân trọng khoảnh khắc trong tình yêu chính là một trong những cách ươm mần cho tương lai thật bền vững,ely tự hào mang đến bạn sự hoàn thiện hơn trong ngày cưới cũng như lưu giữ giúp bạn lưu giữ những giây phút đáng nhớ nhất.\r\n\r\nTại showrrom Ely hiện đang có khoảng 200 mẫu áo cưới được nhập từ Hàn Quốc,với những yêu cầu khắt khe về thẩm mỹ,xu hường thời trang,chất liệu vải và công nghệ may\r\n\r\nNhững mẫu áo cưới của Ely không hiện thị toàn bộ trên web,vậy kính mời quý khách đến showrrom để được tư vấn và lựa chọn những mẫu áo phù hợp ', '', '', '2013-06-12 14:44:00', '0000-00-00 00:00:00', '2013-06-14 23:23:52', 5, 1, 1);
