INSERT INTO mod_customer_ideals (`ID`, `full_name`, `website`, `active`, `trong_luong`, `noi_dung`, `date_upd`) VALUES (1, 'Nguyễn Văn Thành', NULL, 1, 0, 'Thời gian 5 ngày là vừa đủ cho tôi để ra mắt một shop bán hàng online. các mẫu giao diện của HDweb cũng rất đa dạng và đẹp. Hơn hết chi phí rẻ giúp tôi giảm đi cảm giác e ngại khi có nhu cầu thành lập trang web. Nếu có nhu cầu thêm 1 trang web khác, tôi sẽ sử dụng dịch vụ của HDweb.', '2013-11-13 22:50:06');
INSERT INTO mod_customer_ideals (`ID`, `full_name`, `website`, `active`, `trong_luong`, `noi_dung`, `date_upd`) VALUES (3, 'Binh.Ho', NULL, 1, 1, 'Phải nói là với giá tiền chỉ hơn 100 ngàn/tháng cho một website như nhà hàng liên hương là quá hợp lý. Màu sắc sau khi được thay đổi lại cũng rất hài hòa với logo của chúng tôi. Tôi thật sự thích dịch vụ của các bạn!', '2013-11-13 23:40:57');
INSERT INTO mod_customer_ideals (`ID`, `full_name`, `website`, `active`, `trong_luong`, `noi_dung`, `date_upd`) VALUES (4, 'Phan An', NULL, 1, 3, 'Thiết kế website lại được khuyến mãi thêm cái logo, đúng là hết sức tuyệt vời. Chất lượng dịch vụ cực tốt, nên tôi khỏi phải lo thuê người quản trị cho web. Từ nay an tâm kinh doanh.', '2013-11-14 20:42:24');
