INSERT INTO mod_html (`ID`, `name`, `tieu_de`, `en_tieu_de`, `noi_dung`, `en_noi_dung`, `thoi_gian`) VALUES (1, 'gioi_thieu', 'Giới thiệu', '', '<p>\r\n	HDweb.vn ra đời nhằm hỗ trợ bạn, những Doanh nh&acirc;n đang khao kh&aacute;t c&oacute; được một c&ocirc;ng cụ hữu &iacute;ch để khởi đầu v&agrave; ph&aacute;t triển việc kinh doanh. Ch&uacute;ng t&ocirc;i định nghĩa đơn giản về Doanh nh&acirc;n như sau, kh&ocirc;ng hẳn bạn phải l&agrave; doanh nghiệp, bạn c&oacute; thể l&agrave; bất kỳ ai miễn l&agrave; bạn đang c&oacute; khao kh&aacute;t l&agrave;m kinh doanh v&agrave; tạo ra gi&aacute; trị cho x&atilde; hội.</p>\r\n<p>\r\n	Ch&iacute;nh từ những khao kh&aacute;t đ&oacute; th&ocirc;i th&uacute;c ch&uacute;ng t&ocirc;i nghi&ecirc;n cứu để cho ra đời một c&ocirc;ng cụ đơn giản nhằm hiện thực h&oacute;a điều đ&oacute; gi&uacute;p bạn.</p>', '', '2013-06-25 21:50:27');
