INSERT INTO mod_intro_slide (`ID`, `name`, `tieu_de`, `en_tieu_de`, `noi_dung`, `en_noi_dung`, `thoi_gian`) VALUES (1, 'gioi_thieu', 'Giới thiệu', '', '<h3 class=\"widget-title\">\r\n	<span>Gian h&agrave;ng tr&ecirc;n Facebook</span></h3>\r\n<p>\r\n	Facebook l&agrave; mạng x&atilde; hội c&oacute; số lượng th&agrave;nh vi&ecirc;n lớn nhất hiện nay v&agrave; kh&ocirc;ng ngừng lớn mạnh. Đồng thời Facebook cũng được biết đến như một k&ecirc;nh quảng b&aacute; hiệu quả v&igrave; n&oacute; tiếp cận trực tiếp đến số lượng đ&ocirc;ng đảo bạn b&egrave; quanh ta. Ezgo gi&uacute;p bạn c&oacute; một cửa h&agrave;ng thực sự tr&ecirc;n Facebook như một m&oacute;n qu&agrave; thực sự l&yacute; th&uacute; v&agrave; bất ngờ d&agrave;nh cho bạn b&egrave;.</p>\r\n<p>\r\n	Tạo Ezgo shop tr&ecirc;n facebook dễ d&agrave;ng v&agrave; chuy&ecirc;n nghiệp theo đ&uacute;ng phong c&aacute;ch SHOP Online.</p>\r\n<h3 class=\"home-title\">\r\n	<span>HƯỚNG DẪN TẠO CỬA H&Agrave;NG TR&Ecirc;N FACEBOOK </span></h3>\r\n<p>\r\n	<b class=\"cam\">B1</b> Tạo Fanpage tr&ecirc;n Facebook</p>\r\n<p>\r\n	Truy cập <a class=\"xanh\" href=\"http://www.facebook.com/pages/create.php\">http://www.facebook.com/pages/create.php</a> chọn Local Business v&agrave; điền đầy đủ th&ocirc;ng tin</p>\r\n<p align=\"center\">\r\n	<img src=\"http://ezgo.vn/wp-content/themes/nevada/images/tn04.jpg\" /></p>\r\n<p>\r\n	<b class=\"cam\">B2</b> Tạo Facebook shop</p>\r\n<p>\r\n	Truy cập <a class=\"xanh\" href=\"http://www.facebook.com/add.php?api_key=190322544333196&amp;pages\"> http://www.facebook.com/add.php?api_key=190322544333196&amp;pages </a> v&agrave; lưu v&agrave;o Fanpage. Tiếp theo bạn trở lại trang Fanpage mới tạo sẽ thấy ứng dụng Welcome, truy cập v&agrave;o ứng dụng n&agrave;y để ch&egrave;n code shop của bạn v&agrave;o như sau:</p>\r\n', '', '2013-06-17 14:10:01');
