INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8227, 48, '', 'Chú ý khẩn cấp đầu tuần', '<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/451376916527542242-chu-y-the-uu-dai-happycard.jpg\" /></p>\n<p style=\"text-align: center;\">\n	Đ&uacute;ng l&agrave; một ch&uacute; &yacute; khẩn cấp, like v&agrave; share nếu bạn cảm thấy đang vui</p>\n<p>\n	<strong><span style=\"font-size: 16px;\">Chuột say</span></strong></p>\n<p>\n	Tr&ecirc;n b&agrave;n nhậu, ba con chuột l&egrave; nh&egrave; với nhau.</p>\n<div>\n	<p>\n		- Tớ rất th&iacute;ch c&aacute;c loại bẫy chuột. Mỗi s&aacute;ng tớ phải nhấc c&aacute;i bẫy l&ecirc;n xuống v&agrave;i chục lần như một c&aacute;ch tập thể dục &ndash; Con thứ nhất n&oacute;i.</p>\n	<p>\n		- C&ograve;n tớ rất th&iacute;ch c&aacute;c loại thuốc độc. Tớ hay xay nhuyễn rồi uống chung với c&agrave; ph&ecirc; mỗi s&aacute;ng &ndash; Con thứ hai n&oacute;i.</p>\n	<p>\n		- Xin lỗi, tớ c&oacute; hẹn với đi chơi với một con m&egrave;o n&ecirc;n kh&ocirc;ng thể tiếp tục nhậu với mấy cậu được &ndash; Con thứ ba n&oacute;i trước khi bỏ đi.</p>\n	<p>\n		<strong style=\"font-size: 16px;\">C&aacute;m ơn:</strong></p>\n	<p>\n		Tại một nh&agrave; h&agrave;ng, một b&agrave; kh&aacute;ch giận dữ la anh hầu b&agrave;n:</p>\n	<p>\n		- Bộ anh muốn giết t&ocirc;i sao m&agrave; cho t&ocirc;i ăn n&uacute;t &aacute;o n&agrave;y ?</p>\n	<p>\n		Anh hầu b&agrave;n mừng rỡ reo l&ecirc;n:</p>\n	<p>\n		- C&aacute;m ơn b&agrave;! C&aacute;m ơn b&agrave;!&nbsp; N&oacute; đ&acirc;y rồi ! Thế m&agrave; t&ocirc;i t&igrave;m n&atilde;y giờ m&agrave; kh&ocirc;ng thấy !</p>\n</div>\n', 'Tại một nhà hàng, một bà khách giận dữ la anh hầu bàn:\n- Bộ anh muốn giết tôi sao mà cho tôi ăn nút áo này ?\nAnh hầu bàn mừng rỡ reo lên:\n- Cám ơn bà! Cám ơn bà!  Nó đây rồi ! Thế mà tôi tìm nãy giờ mà không thấy !', 'Tại một nhà hàng, một bà khách giận dữ la anh hầu bàn:\n- Bộ anh muốn giết tôi sao mà cho tôi ăn nút áo này ?\nAnh hầu bàn mừng rỡ reo lên:\n- Cám ơn bà! Cám ơn bà!  Nó đây rồi ! Thế mà tôi tìm nãy giờ mà không thấy !');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8220, 41, '', 'Chuyện lạ  - Hoa súng hình Tượng Phật', '<p style=\"text-align: justify;\">\n	Dưới đ&acirc;y l&agrave; một số h&igrave;nh ảnh về hoa s&uacute;ng h&igrave;nh một vị phật m&agrave; happycard nhận được. Giống như một kiệt t&aacute;c của thi&ecirc;n nhi&ecirc;n, bạn đọc chi&ecirc;m ngưỡng nh&eacute;:&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/69280554979527040-hoa-sung-hinh-tuong-phat-1.jpg\" /></p>\n<p style=\"text-align: center;\">\n	<span style=\"color:#f00;\">H&igrave;nh ảnh hoa s&uacute;ng trong ao</span></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/232033845324480119-hoa-sung-hinh-tuong-phat-2.jpg\" /></p>\n<div style=\"text-align: justify;\">\n	Địa chỉ nơi xuất hiện điều kỳ diệu:&nbsp;<span style=\"text-align: center;\">Cửa h&agrave;ng Vật liệu x&acirc;y dựng T&Aacute;M TI&Ecirc;N, 31 A, Ấp 5, X&atilde; Phước Lợi, Huyện Bến Lức, Tỉnh Long An....việc n&agrave;y xảy ra ng&agrave;y 17/09/2013.</span></div>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/3469716743674923735-hoa-sung-hinh-tuong-phat-3.jpg\" /></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/1246975916483978220-hoa-sung-hinh-tuong-phat-4.jpg\" /></p>\n<p style=\"text-align: center;\">\n	<span style=\"color:#f00;\">H&igrave;nh ảnh hoa s&uacute;ng sau khi được h&aacute;i l&ecirc;n</span></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/2349941995839630825-hoa-sung-hinh-tuong-phat-5.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	Trong v&ograve;ng 1 ng&agrave;y m&agrave; c&oacute; nhiều sự thay đổi&nbsp;l&uacute;c dưới ao l&agrave; PHẬT nhỏ, giống như ch&uacute; tiểu nhưng tấm h&igrave;nh chụp l&uacute;c 12h đ&ecirc;m th&igrave; ra h&igrave;nh &ocirc;ng PHẬT r&otilde; r&agrave;ng.&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/1678142147121162808-7.jpg\" /></p>\n<p style=\"text-align: center;\">\n	<span style=\"color:#f00;\">Hoa s&uacute;ng tượng phật được đặt &nbsp;tr&ecirc;n b&agrave;n thờ</span></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/48167749560496951-9.jpg\" /></p>\n<p style=\"text-align: center;\">\n	<span style=\"color:#f00;\">Địa điểm xuất hiện sự kiện lạ</span></p>\n', 'Chuyện lạ - Hoa súng hình Tượng Phật - Địa chỉ nơi xuất hiện điều kỳ diệu: Cửa hàng Vật liệu xây dựng TÁM TIÊN, 31 A, Ấp 5, Xã Phước Lợi, Huyện Bến Lức, Tỉnh Long An....việc này xảy ra ngày 17/09/2013.', 'Chuyện lạ - Hoa súng hình Tượng Phật - Địa chỉ nơi xuất hiện điều kỳ diệu: Cửa hàng Vật liệu xây dựng TÁM TIÊN, 31 A, Ấp 5, Xã Phước Lợi, Huyện Bến Lức, Tỉnh Long An....việc này xảy ra ngày 17/09/2013.');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8221, 42, '', 'Sự kỳ lạ của những tảng đá', '<p style=\"text-align: justify;\">\n	Khu vực đầu ti&ecirc;n bao gồm nhiều nấm đ&aacute; v&agrave; đ&aacute; gừng. C&aacute;c h&igrave;nh dạng đ&aacute; rất kỳ quặc, độc đ&aacute;o, phần nhiều l&agrave; do sự t&aacute;c động của s&oacute;ng biển. C&oacute; thể thấy sự xuất hiện của tảng đ&aacute; h&igrave;nh nến, kem nến&hellip;.</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/1381065486733543689-nhung-tang-da-ky-la-3.JPG\" /></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/3267546443454079311-nhung-tang-da-ky-la-5.jpg\" /></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/963981968762713975-nhung-tang-da-ky-la-4.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	Khu vực thứ hai cũng tương tự như khu vực một, tuy nhi&ecirc;n số lượng nấm đ&aacute; v&agrave; đ&aacute; gừng &iacute;t hơn. Do khu vực gần biển, chịu sự ăn m&ograve;n của nước biển n&ecirc;n đ&aacute; ph&aacute;t sinh th&agrave;nh 4 dạng kh&aacute;c nhau như đ&aacute; voi, đ&aacute; h&igrave;nh chiếc gi&agrave;y, đ&aacute; đất v&agrave; đ&aacute; đậu.&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/279120883272536376-nhung-tang-da-ky-la-1.jpg\" /></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/1531898234561763758-nhung-tang-da-ky-la-6.JPG\" /></p>\n<p style=\"text-align: justify;\">\n	Khu vực thứ ba bao gồm nhiều khu dự trữ sinh th&aacute;i của Yehliu, c&aacute;c cảnh quan đ&aacute; nổi tiếng v&agrave; thu h&uacute;t phần đ&ocirc;ng kh&aacute;ch du lịch tr&ecirc;n thế giới.</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/395671737222989447-nhung-tang-da-ky-la-2.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	<span style=\"text-align: justify;\">Bạn sẽ chứng kiến tất cả sự kỳ lạ tr&ecirc;n tại&nbsp;</span><strong style=\"text-align: justify;\">C&ocirc;ng vi&ecirc;n địa chất Yehliu</strong><span style=\"text-align: justify;\">. &nbsp;Hiếm c&oacute; nơi n&agrave;o tr&ecirc;n thế giới xuất hiện những cảnh quan k&igrave; vĩ v&agrave; đẹp lạ lụng n&agrave;y.&nbsp;</span><strong style=\"text-align: justify;\">C&ocirc;ng vi&ecirc;n địa chất Yehliu nổi tiếng bởi sự độc đ&aacute;o</strong><span style=\"text-align: justify;\">, h&igrave;nh d&aacute;ng c&oacute; một kh&ocirc;ng hai của c&aacute;c loại đ&aacute; tại đ&acirc;y.</span></p>\n', 'Bạn sẽ chứng kiến tất cả sự kỳ lạ trên tại Công viên địa chất Yehliu.  Hiếm có nơi nào trên thế giới xuất hiện những cảnh quan kì vĩ và đẹp lạ lụng này. Công viên địa chất Yehliu nổi tiếng bởi sự độc đáo, hình dáng có một khô', 'Bạn sẽ chứng kiến tất cả sự kỳ lạ trên tại Công viên địa chất Yehliu.  Hiếm có nơi nào trên thế giới xuất hiện những cảnh quan kì vĩ và đẹp lạ lụng này. Công viên địa chất Yehliu nổi tiếng bởi sự độc đáo, hình dáng có một khô');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8222, 43, '', 'Bức ảnh cảm động nhất thế giới', '<p style=\"text-align: justify;\">\n	<strong><em>Đ&ocirc;i khi trong cuộc sống, người ta kinh sợ những thứ c&oacute; thể g&acirc;y hại cho m&igrave;nh. </em></strong></p>\n<p style=\"text-align: justify;\">\n	<strong><em>C&oacute; những thứ đ&aacute;ng sợ hơn, chẳng hạn sự &iacute;ch kỉ v&agrave; l&ograve;ng đố kị? Nhưng ...<br />\n	</em></strong></p>\n<p style=\"text-align: justify;\">\n	<strong><em>... C&oacute; những thứ kh&ocirc;ng như vẻ bề ngo&agrave;i của n&oacute;&hellip;</em></strong></p>\n<p style=\"text-align: justify;\">\n	Người đ&agrave;n &ocirc;ng&nbsp; v&agrave; con hổ&nbsp; trong bức ảnh từng c&oacute; thời gian sống gắn b&oacute; với nhau. Sau một thời gian xa c&aacute;ch, &ocirc;ng quay trở về thăm người bạn năm xưa. Nhưng đ&oacute; cũng l&agrave; l&uacute;c con hổ phải về với gia đ&igrave;nh mới của n&oacute;. Những giọt nước mắt buồn đau lăn tr&ecirc;n gương mặt người đ&agrave;n &ocirc;ng, v&agrave; một c&aacute;i cho&agrave;ng tay &acirc;u yếm của con hổ, như một c&aacute;ch thể hiện sự tiếc nuối khi chia l&igrave;a.</p>\n<p style=\"text-align: justify;\">\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/2001306738887145863-buc-anh-cam-dong-nhat-the-gioi.png\" /></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<em>Bức ảnh n&agrave;y được xem l&agrave; một trong những bức ảnh cảm động nhất thế giới.</em></p>\n', 'Đôi khi trong cuộc sống, người ta kinh sợ những thứ có thể gây hại cho mình.\n\nCó những thứ đáng sợ hơn, chẳng hạn sự ích kỉ và lòng đố kị? Nhưng ...\n\n... Có những thứ không như vẻ bề ngoài của nó…', 'Đôi khi trong cuộc sống, người ta kinh sợ những thứ có thể gây hại cho mình.\n\nCó những thứ đáng sợ hơn, chẳng hạn sự ích kỉ và lòng đố kị? Nhưng ...\n\n... Có những thứ không như vẻ bề ngoài của nó…');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8223, 44, '', 'Tình trạng thiếu nước sạch toàn cầu', '<h2 style=\"text-align: justify;\">\n	Bạn đang sử dụng nước l&atilde;ng ph&iacute;, bạn kh&ocirc;ng để &yacute; hay chỉ v&igrave; qu&aacute; v&ocirc; t&acirc;m...</h2>\n<h2 style=\"text-align: justify;\">\n	Mỗi năm, t&igrave;nh trạng thiếu nước sạch giết chết 1,2 triệu trẻ em dưới 5 tuổi.</h2>\n<div>\n	<div style=\"text-align: justify;\">\n		Ng&agrave;y 22 th&aacute;ng 3 h&agrave;ng năm đ&atilde; được Li&ecirc;n Hiệp Quốc chọn l&agrave;m Ng&agrave;y Nước Thế giới - ng&agrave;y để con người nh&igrave;n lại tầm quan trọng của t&agrave;i nguy&ecirc;n qu&yacute; gi&aacute; bậc nhất tr&ecirc;n Tr&aacute;i đất.&nbsp;Nước l&agrave; t&agrave;i nguy&ecirc;n chiếm 3/4 diện t&iacute;ch Địa cầu nhưng chỉ c&oacute; khoảng 2,5% trong tổng số đ&oacute; l&agrave; nước c&oacute; thể sử dụng được.</div>\n	<div style=\"text-align: justify;\">\n		&nbsp;</div>\n	<div style=\"text-align: justify;\">\n		Nước l&agrave; một thứ kh&ocirc;ng thể thiếu trong đời sống của con người v&agrave; con người chỉ c&oacute; thể nhịn kh&aacute;t trong tối đa l&agrave; 5 ng&agrave;y. Tất nhi&ecirc;n, c&acirc;u hỏi được đặt ra l&agrave;: Liệu c&oacute; phải tất cả ch&uacute;ng ta đều c&oacute; đủ nước để d&ugrave;ng?</div>\n	<div>\n		<div>\n			<table cellpadding=\"0\" cellspacing=\"5\">\n				<tbody>\n					<tr>\n						<td>\n							<p style=\"text-align: center;\">\n								<img src=\"http://happycard.vn/images/news/3800662827926416853-tinh-trang-thieu-nuoc-sach-toan-cau-1.jpg\" /></p>\n							<div>\n								<p style=\"text-align: justify;\">\n									<span style=\"font-size: 12px;\">Một cậu bạn đang thỏa th&iacute;ch tắm m&aacute;t tại một v&ograve;i nước c&ocirc;ng cộng ở Sri Lanka. B&aacute;o c&aacute;o của UNICEF cho biết, t&igrave;nh trạng mất vệ sinh do thiếu nước sinh hoạt đ&atilde; g&acirc;y ra c&aacute;i chết của 1,2 triệu trẻ em dưới 5 tuổi mỗi năm. L&yacute; do g&acirc;y ra việc n&agrave;y l&agrave; nguồn cung cấp nước kh&ocirc;ng thể theo kịp t&igrave;nh trạng b&ugrave;ng nổ d&acirc;n số</span></p>\n								<p style=\"text-align: center;\">\n									<img src=\"http://happycard.vn/images/news/818665665036703973-tinh-trang-thieu-nuoc-sach-toan-cau-2.jpg\" /></p>\n							</div>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n		</div>\n		<div>\n			<div>\n				<table cellpadding=\"0\" cellspacing=\"5\">\n					<tbody>\n						<tr>\n							<td>\n								<p style=\"text-align: justify;\">\n									<span style=\"font-size: 12px;\">T&igrave;nh trạng thiếu nước khiến hai người đ&agrave;n &ocirc;ng n&agrave;y phải chấp nhận tắm bằng nước từ một lỗ r&ograve; tr&ecirc;n ống dẫn nước, b&ecirc;n dưới tr&agrave;n ngập r&aacute;c thải. Sự hiện diện của con quạ cũng khiến người ta phải suy ngẫm rất nhiều.</span></p>\n							</td>\n						</tr>\n					</tbody>\n				</table>\n			</div>\n			<div>\n				<div>\n					<div style=\"text-align: justify;\">\n						<table cellpadding=\"0\" cellspacing=\"5\" style=\"font-size: 12px;\">\n							<tbody>\n								<tr>\n									<td>\n										<p style=\"text-align: center;\">\n											<img src=\"http://happycard.vn/images/news/1252942586968778188-tinh-trang-thieu-nuoc-sach-toan-cau-3.jpg\" /></p>\n										<div>\n											Bờ biển ở khu vực Qingdao, Trung Quốc bị x&acirc;m lấn bởi một loại tảo xanh, ảnh hưởng trực tiếp đến việc đ&aacute;nh bắt c&aacute; v&agrave; du lịch. Tuy nhi&ecirc;n, xem ra c&aacute;c cậu b&eacute; n&agrave;y lại kh&ocirc;ng lo lắng lắm đến vấn đề đ&oacute;.</div>\n										<div>\n											&nbsp;</div>\n										<div style=\"text-align: center;\">\n											<img src=\"http://happycard.vn/images/news/1545109189302357572-tinh-trang-thieu-nuoc-sach-toan-cau-4.jpg\" /></div>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n					</div>\n				</div>\n				<div>\n					<div>\n						<table cellpadding=\"0\" cellspacing=\"5\">\n							<tbody>\n								<tr>\n									<td>\n										<div>\n											<p style=\"text-align: center;\">\n												<span style=\"text-align: justify; font-size: 12px;\">C&ocirc; b&eacute; n&agrave;y đang rửa ch&acirc;n tại một v&ograve;i nước c&ocirc;ng cộng ở Baia More, Romania. Xung quanh l&agrave; những hố ngập &uacute;ng, r&aacute;c thải.</span></p>\n										</div>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n					</div>\n					<div>\n						<div>\n							<table cellpadding=\"0\" cellspacing=\"5\">\n								<tbody>\n									<tr>\n										<td>\n											<div>\n												<p style=\"text-align: center;\">\n													<img src=\"http://happycard.vn/images/news/678398381246668564-tinh-trang-thieu-nuoc-sach-toan-cau-5.jpg\" /></p>\n												<div style=\"text-align: justify;\">\n													Nghịch l&yacute; ở những trận lũ lụt l&agrave; tuy nước rất nhiều, nhưng t&igrave;nh trạng thiếu nước uống lại diễn ra rất trầm trọng do những quan ngại về bệnh dịch. Trong ảnh l&agrave; một người phụ nữ đang vận chuyển nước trong trận lũ tại một khu nằm ở ph&iacute;a Bắc Thủ đ&ocirc; Manila của Philippines.</div>\n												<div style=\"text-align: justify;\">\n													&nbsp;</div>\n												<div style=\"text-align: center;\">\n													<img src=\"http://happycard.vn/images/news/2244334995471479313-tinh-trang-thieu-nuoc-sach-toan-cau-6.jpg\" /></div>\n											</div>\n										</td>\n									</tr>\n								</tbody>\n							</table>\n						</div>\n						<div>\n							<table cellpadding=\"0\" cellspacing=\"5\">\n								<tbody>\n									<tr>\n										<td>\n											<p style=\"text-align: justify;\">\n												<span style=\"font-size: 12px;\">Hai c&ocirc;ng nh&acirc;n đang đổ chất thải vệ sinh từ nh&agrave; m&aacute;y ra một con suối ở khu ổ chuột Korogocho, Nairobi, Kenya. Đ&acirc;y c&oacute; lẽ l&agrave; một trong những nguồn g&acirc;y ra c&aacute;i chết cho 1,5 triệu trẻ em h&agrave;ng năm do bệnh k&yacute; sinh từ &ocirc; nhiễm nguồn nước.</span></p>\n											<p style=\"text-align: center;\">\n												<img src=\"http://happycard.vn/images/news/617185365879701560-tinh-trang-thieu-nuoc-sach-toan-cau-7.jpg\" /></p>\n										</td>\n									</tr>\n								</tbody>\n							</table>\n						</div>\n						<div>\n							<div>\n								<table cellpadding=\"0\" cellspacing=\"5\">\n									<tbody>\n										<tr>\n											<td>\n												<div>\n													<p style=\"text-align: justify;\">\n														<span style=\"font-size: 12px;\">Tuvalu, một quần đảo san h&ocirc; nằm ở ph&iacute;a Bắc Fiji đang phải chịu một đợt hạn h&aacute;n lớn v&agrave; thiếu nước trầm trọng do nguồn nước ngầm bị x&acirc;m lấn bởi nước biển. Ch&iacute;nh phủ &Uacute;c, New Zealand v&agrave; Mỹ đang hỗ trợ những m&aacute;y khử muối để gi&uacute;p đỡ hơn 10.000 người d&acirc;n tr&ecirc;n đảo n&agrave;y.</span></p>\n												</div>\n											</td>\n										</tr>\n									</tbody>\n								</table>\n							</div>\n							<div>\n								<div style=\"text-align: center;\">\n									<img src=\"http://happycard.vn/images/news/1699402741756773726-tinh-trang-thieu-nuoc-sach-toan-cau-8.jpg\" /></div>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n			<div>\n				<div style=\"text-align: justify;\">\n					&nbsp;</div>\n				<div>\n					<div>\n						<table cellpadding=\"0\" cellspacing=\"5\">\n							<tbody>\n								<tr>\n									<td>\n										<p style=\"text-align: justify;\">\n											<span style=\"font-size: 12px;\">Một ph&uacute;t nghỉ ngơi hiếm hoi của c&ocirc; g&aacute;i h&aacute;i tr&agrave; người Ấn Độ. Sự thay đổi kh&iacute; hậu, hay cụ thể l&agrave; những đợt nắng n&oacute;ng k&eacute;o d&agrave;i dẫn đến hạn h&aacute;n, thiếu nước tưới ti&ecirc;u đ&atilde; l&agrave;m cho sản lượng tr&agrave; tại Ấn Độ giảm s&uacute;t nghi&ecirc;m trọng.</span></p>\n										<p style=\"text-align: center;\">\n											<img src=\"http://happycard.vn/images/news/1359014399314029908-tinh-trang-thieu-nuoc-sach-toan-cau-9.jpg\" /></p>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n					</div>\n					<div style=\"text-align: justify;\">\n						<table cellpadding=\"0\" cellspacing=\"5\" style=\"font-size: 12px;\">\n							<tbody>\n								<tr>\n									<td>\n										<p>\n											<span style=\"font-size: 12px;\">Ch&agrave;ng thanh ni&ecirc;n tị nạn n&agrave;y đang lấy nước từ giếng trong một khu ổ chuột ngoại &ocirc; Islamabad, Pakistan.</span></p>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n					</div>\n				</div>\n			</div>\n			<div>\n				<table cellpadding=\"0\" cellspacing=\"5\">\n					<tbody>\n						<tr>\n							<td>\n								<p style=\"text-align: center;\">\n									<img border=\"0\" src=\"http://happycard.vn/images/news/384728856688121621-tinh-trang-thieu-nuoc-sach-toan-cau-10.jpg\" /></p>\n								<p style=\"text-align: justify;\">\n									<span style=\"font-size: 12px;\">Người d&acirc;n của một l&agrave;ng nhỏ tại tỉnh Yunnan, Trung Quốc đang g&aacute;nh nước lấy từ giếng về l&agrave;ng. Hạn h&aacute;n k&eacute;o d&agrave;i ở khu vực n&agrave;y đ&atilde; l&agrave;m kh&ocirc; hạn 273 con s&ocirc;ng, 413 bể chứa v&agrave; khiến cho 3,19 triệu người c&ugrave;ng với 1,58 triệu vật nu&ocirc;i l&acirc;m v&agrave;o cảnh thiếu nước uống trầm trọng.</span></p>\n							</td>\n						</tr>\n					</tbody>\n				</table>\n			</div>\n			<div>\n				<div>\n					<div style=\"text-align: justify;\">\n						&nbsp;</div>\n					<div>\n						<table cellpadding=\"0\" cellspacing=\"5\">\n							<tbody>\n								<tr>\n									<td>\n										<p style=\"text-align: center;\">\n											<img src=\"http://happycard.vn/images/news/749296807014976630-tinh-trang-thieu-nuoc-sach-toan-cau-11.jpg\" style=\"font-size: 12px; text-align: center;\" /></p>\n										<div>\n											<p style=\"text-align: justify;\">\n												<span style=\"font-size: 12px;\">Một ch&uacute; b&eacute; Afghanistan đang vận chuyển nước về nh&agrave; ở trại tị nạn tại Kabul trong cơn b&atilde;o tuyết. Rất nhiều v&ugrave;ng l&acirc;n cận tại khu vực n&agrave;y, người d&acirc;n ho&agrave;n to&agrave;n kh&ocirc;ng thể đến được nơi cung cấp nước.</span></p>\n										</div>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n					</div>\n				</div>\n				<div>\n					<div>\n						<table cellpadding=\"0\" cellspacing=\"5\">\n							<tbody>\n								<tr>\n									<td>\n										<div style=\"text-align: center;\">\n											<img border=\"0\" src=\"http://happycard.vn/images/news/149341382270711968-tinh-trang-thieu-nuoc-sach-toan-cau-12.jpg\" style=\"font-size: 12px;\" /></div>\n										<div style=\"text-align: justify;\">\n											Một con t&agrave;u bị mắc cạn ngay tại s&ocirc;ng Danube ở Belgrade, Serbia. Mực nước con s&ocirc;ng n&agrave;y v&agrave; hai s&ocirc;ng Save, Drina đ&atilde; xuống mức thấp kỷ lục trong 30 năm qua, khiến cho gi&aacute; cả năng lượng tăng ch&oacute;ng mặt.</div>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n					</div>\n					<div style=\"text-align: justify;\">\n						&nbsp;</div>\n				</div>\n			</div>\n			<div>\n				<table cellpadding=\"0\" cellspacing=\"5\">\n					<tbody>\n						<tr>\n							<td>\n								<p style=\"text-align: center;\">\n									<img border=\"0\" src=\"http://happycard.vn/images/news/1778257436427508505-tinh-trang-thieu-nuoc-sach-toan-cau-13.jpg\" style=\"font-size: 12px;\" /></p>\n								<div style=\"text-align: justify;\">\n									Một người tị nạn ở trại Dagahaley, Kenya với chiếc can nhựa đi xin nước. Cuộc nội chiến k&eacute;o d&agrave;i c&ugrave;ng với nạn hạn h&aacute;n diễn ra hơn 60 năm qua đ&atilde; khiến cho cuộc sống của 12 triệu người d&acirc;n Somalia bị đe dọa trầm trọng.</div>\n							</td>\n						</tr>\n					</tbody>\n				</table>\n			</div>\n			<div>\n				<table cellpadding=\"0\" cellspacing=\"5\">\n					<tbody>\n						<tr>\n							<td>\n								<p style=\"text-align: center;\">\n									<img border=\"0\" src=\"http://happycard.vn/images/news/395355378631030095-tinh-trang-thieu-nuoc-sach-toan-cau-15.jpg\" style=\"font-size: 12px;\" /></p>\n								<div>\n									<div style=\"text-align: justify;\">\n										Ch&uacute; b&eacute; n&agrave;y đang cố gắng uống được c&agrave;ng nhiều nước c&agrave;ng tốt tại một điểm ph&acirc;n ph&aacute;t nước ở Bắc Darfur, Sudan trong một chiến dịch ph&acirc;n ph&aacute;t 40.000 l&iacute;t nước sạch đến cộng đồng. D&ugrave; số lượng hạn hẹp, nhiều người phải vượt qu&atilde;ng đường &iacute;t nhất 15km để c&oacute; thể đến được điểm ph&aacute;t nước gần nhất.</div>\n								</div>\n							</td>\n						</tr>\n					</tbody>\n				</table>\n			</div>\n			<div>\n				<table cellpadding=\"0\" cellspacing=\"5\">\n					<tbody>\n						<tr>\n							<td>\n								<p style=\"text-align: center;\">\n									<img border=\"0\" src=\"http://happycard.vn/images/news/462368336495934341-tinh-trang-thieu-nuoc-sach-toan-cau-16.jpg\" style=\"font-size: 12px;\" /></p>\n								<div>\n									<div style=\"text-align: justify;\">\n										Những người đ&agrave;n &ocirc;ng n&agrave;y đang cố gắng chắt chiu những giọt nước cuối c&ugrave;ng từ một giếng ở Shendi, Sudan. Thiếu nước đ&atilde; trở th&agrave;nh mối lo thường nhật cho tất cả c&aacute;c gia đ&igrave;nh tại khu vực n&agrave;y.</div>\n								</div>\n							</td>\n						</tr>\n					</tbody>\n				</table>\n			</div>\n			<div>\n				<div>\n					<table cellpadding=\"0\" cellspacing=\"5\">\n						<tbody>\n							<tr>\n								<td>\n									<div>\n										<p style=\"text-align: center;\">\n											<img border=\"0\" src=\"http://happycard.vn/images/news/112982838204979371-tinh-trang-thieu-nuoc-sach-toan-cau-17.jpg\" /></p>\n										<div style=\"text-align: justify;\">\n											Đứa trẻ suy dinh dưỡng n&agrave;y đang nằm tr&ecirc;n s&agrave;n bệnh viện ở Mogadishu, Somalia. Khu vực Sừng ch&acirc;u Phi đang trong t&igrave;nh trạng hạn h&aacute;n hết sức tồi tệ g&acirc;y ra sự thiếu nước v&agrave; nạn đ&oacute;i triền mi&ecirc;n. Hơn 10 triệu người sống tại c&aacute;c nước Djibouti, Ethiopia, Kenya, Somalia v&agrave; Uganda đang phải chịu ảnh hưởng rất nặng nề v&agrave; t&igrave;nh h&igrave;nh mỗi l&uacute;c lại xấu đi.</div>\n									</div>\n								</td>\n							</tr>\n						</tbody>\n					</table>\n				</div>\n				<div style=\"text-align: justify;\">\n					&nbsp;</div>\n			</div>\n			<div>\n				<span style=\"font-size:16px;\"><strong><span style=\"text-align: justify;\">Vậy bạn c&oacute; thể l&agrave;m g&igrave; để tiết kiệm nước sạch? Thử những c&aacute;ch đơn giản dưới đ&acirc;y xem sao!</span></strong></span></div>\n		</div>\n	</div>\n	<div style=\"text-align: justify;\">\n		&nbsp;</div>\n	<div style=\"text-align: justify;\">\n		- Đ&aacute;nh răng: D&ugrave;ng cốc đựng nước để s&uacute;c miệng, thay v&igrave; để nước chảy thẳng từ v&ograve;i.</div>\n	<div style=\"text-align: justify;\">\n		- Tắm: Sử dụng v&ograve;i hoa sen thay v&igrave; tắm bồn.<br />\n		- Kh&ocirc;ng n&ecirc;n mở v&ograve;i nước to hết cỡ khi sử dụng.</div>\n	<div style=\"text-align: justify;\">\n		- T&aacute;i sử dụng nước rửa rau để tưới c&acirc;y, rửa s&acirc;n.</div>\n	<div style=\"text-align: justify;\">\n		- Thường xuy&ecirc;n kiểm tra xem c&aacute;c v&ograve;i nước trong nh&agrave; c&oacute; bị r&ograve; rỉ hay kh&ocirc;ng.</div>\n	<div style=\"text-align: justify;\">\n		<br />\n		Ngo&agrave;i ra, cần giữ sạch nguồn nước bằng c&aacute;ch kh&ocirc;ng vứt r&aacute;c xuống ao hồ, tr&aacute;nh g&acirc;y &ocirc; nhiễm nguồn nước.</div>\n	<div style=\"text-align: justify;\">\n		&nbsp;</div>\n	<div style=\"text-align: justify;\">\n		<strong><span style=\"font-size:16px;\">Nếu bạn c&oacute; s&aacute;ng kiến tiết kiệm v&agrave; giữ sạch nguồn nước, h&atilde;y chia sẻ th&ecirc;m với ch&uacute;ng tớ bằng c&aacute;ch comment b&ecirc;n dưới nh&eacute;!</span></strong></div>\n</div>\n', 'Ngày 22 tháng 3 hàng năm đã được Liên Hiệp Quốc chọn làm Ngày Nước Thế giới - ngày để con người nhìn lại tầm quan trọng của tài nguyên quý giá bậc nhất trên Trái đất. Nước là tài nguyên chiếm 3/4 diện tích Địa cầu nhưng chỉ c', 'Ngày 22 tháng 3 hàng năm đã được Liên Hiệp Quốc chọn làm Ngày Nước Thế giới - ngày để con người nhìn lại tầm quan trọng của tài nguyên quý giá bậc nhất trên Trái đất. Nước là tài nguyên chiếm 3/4 diện tích Địa cầu nhưng chỉ c');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8245, 66, '', 'Chìa khóa thành công khi thiết kế một website', '<h2 style=\"text-align: justify;\">\n	Ch&igrave;a kh&oacute;a th&agrave;nh c&ocirc;ng để thiết kế 1 website?</h2>\n<div>\n	<div>\n		<p style=\"text-align: justify;\">\n			Thiết kế website l&agrave; một chủ để ng&agrave;y c&agrave;ng trở n&ecirc;n cần thiết v&agrave; quan trọng cho tất cả c&aacute;c hoạt động kinh doanh. Cộng đồng tr&ecirc;n mạng đang ph&aacute;t triển mạnh mẽ với bộ mặt thay đổi h&agrave;ng ng&agrave;y.<br />\n			<br />\n			Mỗi một cơ hội kinh doanh được thiết lập th&igrave; h&igrave;nh ảnh của họ xuất hiện o&shy;nline, sự cạnh tranh cũng từ đ&oacute; mở rộng từ thị trường địa phương ra thị trường to&agrave;n cầu. Hiện nay hầu hết c&aacute;c sản phẩm đều sẵn s&agrave;ng cho việc t&igrave;m hiểu v&agrave; mua b&aacute;n trực tuyến. Điều n&agrave;y l&agrave;m tăng th&ecirc;m sự cần thiết cho tất cả c&aacute;c hoạt động kinh doanh phải c&oacute; sự hiện diện trực tuyến tr&ecirc;n mạng. Trong l&uacute;c cộng đồng Internet đang ph&aacute;t triển nhanh th&igrave; sẽ c&oacute; c&agrave;ng nhiều người d&ugrave;ng tham gia v&agrave;o qu&aacute; tr&igrave;nh n&agrave;y.<br />\n			<br />\n			Ng&agrave;y nay, kh&aacute;ch h&agrave;ng rất thấu hiểu những g&igrave; đang xảy ra xung quanh từng giờ một. Trong khi một v&agrave;i kh&aacute;ch h&agrave;ng t&igrave;m kiếm sản phẩm, th&igrave; cũng nhiều kh&aacute;ch h&agrave;ng kh&aacute;c muốn lựa chọn để mua h&agrave;ng trực tuyến. Cũng như bất kỳ bước kinh doanh n&agrave;o tr&ecirc;n cộng đồng internet, họ lu&ocirc;n cần tự hỏi &quot;T&ocirc;i cần phải l&agrave;m g&igrave; để thu h&uacute;t kh&aacute;ch h&agrave;ng mua h&agrave;ng tr&ecirc;n website của m&igrave;nh?&quot;. Điều đ&oacute; kh&ocirc;ng c&oacute; g&igrave; b&iacute; mật d&ugrave; rằng việc x&acirc;y dựng website ho&agrave;n to&agrave;n kh&ocirc;ng hề đơn giản, tuy nhi&ecirc;n b&iacute; quyết ch&iacute;nh l&agrave; thiết lập những bộ phận kinh doanh xuất ph&aacute;t từ lợi thế cạnh tranh.<br />\n			<br />\n			Điều quan trọng nhất cần nhớ khi thiết kế website l&agrave; sự tiện lợi v&agrave; sự th&acirc;n thiện với kh&aacute;ch h&agrave;ng. Một kh&aacute;ch h&agrave;ng sẽ kh&ocirc;ng chịu mất nhiều thời gian để tiếp cận với những trang web kh&oacute; hiểu hoặc phức tạp. Nếu bạn c&oacute; thể giữ cho website của m&igrave;nh thật tiện lợi, th&acirc;n thiện với kh&aacute;ch h&agrave;ng v&agrave; c&oacute; t&iacute;nh thẩm mỹ cao th&igrave; đảm bảo rằng c&ocirc;ng cuộc kinh doanh của bạn sẽ gia tăng lợi v&agrave; đảm bảo được đầu tư của m&igrave;nh.<br />\n			<br />\n			1. Hạn chế đồ hoạ:<br />\n			<br />\n			Những kỹ xảo đồ hoạ l&agrave; rất cần thiết, nhưng việc đưa v&agrave;o qu&aacute; nhiều trong website sẽ l&agrave;m cho thời gian tải trang web của kh&aacute;ch h&agrave;ng l&acirc;u hơn v&agrave; g&acirc;y cảm gi&aacute;c tải trang rất chậm. Trong khi bạn d&ugrave;ng đường thu&ecirc; bao số tốc độ cao th&igrave; bạn phải hiểu rằng c&ograve;n c&oacute; rất nhiều kh&aacute;ch h&agrave;ng đang d&ugrave;ng internet qua đường quay số (dial up) với tốc độ rất thấp. Cũng như vậy, việc đưa qu&aacute; nhiều đồ hoạ v&agrave;o trang web sẽ l&agrave; nguy&ecirc;n nh&acirc;n g&acirc;y ra sự hỗn độ kh&ocirc;ng tập trung v&agrave;o những th&ocirc;ng tin cần thiết v&agrave; nhiều khi n&oacute; l&agrave; nguy&ecirc;n nh&acirc;n g&acirc;y ra mất kết nối trong qu&aacute; tr&igrave;nh tải web về.<br />\n			<br />\n			2. Sử dụng ng&ocirc;n ngữ tự nhi&ecirc;n:<br />\n			<br />\n			Khi thiết lập website, bạn n&ecirc;n sử dụng ng&ocirc;n ngữ h&agrave;ng ng&agrave;y. Thậm ch&iacute; nhiều kh&aacute;ch h&agrave;ng muốn &quot;thư gi&atilde;n&quot; qua lời lẽ tr&igrave;nh b&agrave;y, đ&acirc;y ch&iacute;nh l&agrave; cơ hội lớn để họ mua h&agrave;ng của bạn.<br />\n			<br />\n			3. Tạo ra c&aacute;c đoạn nội dung ngắn v&agrave; sử dụng gạch đầu d&ograve;ng:<br />\n			<br />\n			Kh&ocirc;ng ai th&iacute;ch đọc những đoạn nội dung d&agrave;i d&ograve;ng. Ngắt đoạn v&agrave; c&aacute;c c&acirc;u d&agrave;i n&ecirc;n sử dụng dạng gạch đầu d&ograve;ng. Tạo cho mắt người đọc chuyển động theo chiều từ tr&ecirc;n xuống l&agrave; ch&iacute;nh thay v&igrave; phải đ&aacute;nh mắt sang hai b&ecirc;n. Sử dụng chữ hoa cho c&aacute;c th&ocirc;ng tin quan trọng. Khi mắt của người xem lướt qua c&aacute;c đoạn nội dung th&igrave; n&ecirc;n thiết kế c&oacute; c&aacute;c khoảng nghỉ.<br />\n			<br />\n			4.Thường xuy&ecirc;n đổi mới site:<br />\n			<br />\n			Quay v&ograve;ng c&aacute;c nội dung l&agrave; v&ocirc; c&ugrave;ng quan trọng. N&oacute; kh&ocirc;ng chỉ gi&uacute;p cho kh&aacute;ch h&agrave;ng c&oacute; một c&aacute;i nh&igrave;n tươi mới về website của bạn m&agrave; c&ograve;n l&agrave; l&yacute; do để họ quay trở lại. Th&ecirc;m nữa, việc quay v&ograve;ng nội dung sẽ gi&uacute;p c&aacute;c bộ m&aacute;y t&igrave;m kiếm nhận biết v&agrave; tăng thứ hạng cho website của bạn.<br />\n			<br />\n			5. C&aacute;c th&ocirc;ng tin quan trọng n&ecirc;n để ở vị tr&iacute; đầu trang:<br />\n			<br />\n			Chiếm sự quan t&acirc;m của kh&aacute;ch h&agrave;ng bằng c&aacute;ch đặt c&aacute;c khuyến mại hoặc những th&ocirc;ng tin quan trọng tr&ecirc;n nửa đầu của trang. Mọi người sẽ kh&ocirc;ng bao giờ phải cuộn m&agrave;n h&igrave;nh để t&igrave;m kiếm những th&ocirc;ng tin n&agrave;y.<br />\n			<br />\n			6. C&oacute; th&ocirc;ng tin li&ecirc;n hệ r&otilde; r&agrave;ng:<br />\n			<br />\n			N&oacute; sẽ dễ d&agrave;ng hơn cho kh&aacute;ch h&agrave;ng trong việc li&ecirc;n hệ hỏi đ&aacute;p hoặc đặt h&agrave;ng. Nếu họ kh&ocirc;ng t&igrave;m thấy th&ocirc;ng tin li&ecirc;n hệ của bạn, họ sẽ tiếp tục mua h&agrave;ng của đối thủ cạnh tranh với bạn. H&atilde;y đặt th&ocirc;ng tin li&ecirc;n hệ ở nơi dễ tr&ocirc;ng thấy v&agrave; dễ tiếp cận v&iacute; dụ như thanh c&ocirc;ng cụ hoặc ti&ecirc;u đề của trang.<br />\n			<br />\n			7. Tr&aacute;nh đưa qu&aacute; nhiều th&ocirc;ng tin tr&ecirc;n một trang:<br />\n			<br />\n			Mọi người muốn đọc th&ocirc;ng tin về c&aacute;c sản phẩm, nhưng đừng cung cấp qu&aacute; nhiều th&ocirc;ng tin về ch&uacute;ng, như vậy sẽ l&agrave;m mất tập trung v&agrave; sự hấp dẫn. H&atilde;y n&ecirc;u sự thật về c&aacute;c t&iacute;nh năng, lợi &iacute;ch với c&aacute;ch tr&igrave;nh b&agrave;y thật ngắn gọn v&agrave; s&uacute;c t&iacute;ch.<br />\n			<br />\n			8. Vận h&agrave;nh thật r&otilde; r&agrave;ng v&agrave; đơn giản:<br />\n			<br />\n			Phải đảm bảo rằng bất kỳ một kh&aacute;ch h&agrave;ng n&agrave;o cũng dễ t&igrave;m những g&igrave; m&agrave; họ cần mua. Tạo t&ecirc;n r&otilde; r&agrave;ng v&agrave; c&oacute; m&ocirc; tả k&egrave;m theo. Th&ecirc;m c&aacute;c tuỳ chọn, kh&aacute;ch h&agrave;ng c&oacute; thể ph&acirc;n biệt sản phẩm được tốt hơn. V&iacute; dụ c&oacute; thể cho ph&eacute;p kh&aacute;ch h&agrave;ng t&igrave;m theo t&ecirc;n sản phẩm, h&atilde;ng sản xuất, gi&aacute; tiền....<br />\n			<br />\n			9. Đặt h&agrave;ng trực tuyến đơn giản:<br />\n			<br />\n			H&atilde;y đem lại cho kh&aacute;ch h&agrave;ng sự dễ d&agrave;ng, nhanh ch&oacute;ng v&agrave; an to&agrave;n khi đặt h&agrave;ng trực tuyến. Tạo ra đơn h&agrave;ng đơn giản tr&ecirc;n m&agrave;n h&igrave;nh nhưng c&oacute; đủ c&aacute;c th&ocirc;ng tin cần thiết. Bằng c&aacute;ch sử dụng c&aacute;c hướng dẫn của thiết kế website bạn sẽ c&oacute; được một website hiệu quả v&agrave; lợi nhuận. N&oacute; sẽ mang lại cho kh&aacute;ch h&agrave;ng sự tiện lợi v&agrave; th&acirc;n thiện khi mua h&agrave;ng. Bạn sẽ c&oacute; được thị trường kh&aacute;ch h&agrave;ng rộng lớn hơn nhiều ngo&agrave;i địa phương của bạn.<br />\n			<br />\n			Ch&uacute;c bạn th&agrave;nh c&ocirc;ng - (Nguồn : thegioiweb)</p>\n	</div>\n</div>\n', 'Thiết kế website là một chủ để ngày càng trở nên cần thiết và quan trọng cho tất cả các hoạt động kinh doanh. Cộng đồng trên mạng đang phát triển mạnh mẽ với bộ mặt thay đổi hàng ngày.', 'Thiết kế website là một chủ để ngày càng trở nên cần thiết và quan trọng cho tất cả các hoạt động kinh doanh. Cộng đồng trên mạng đang phát triển mạnh mẽ với bộ mặt thay đổi hàng ngày.');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8246, 67, '', 'SEO, dịch vụ SEO web chuyên nghiệp', '<h1 style=\"text-align: justify;\">\n	SEO, dịch vụ SEO web chuy&ecirc;n nghiệp</h1>\n<p style=\"text-align: justify;\">\n	<strong>X&acirc;y dựng website đ&atilde; kh&oacute;, l&agrave;m cho mọi người t&igrave;m thấy v&agrave; sử dụng website lại c&agrave;ng kh&oacute; hơn!&quot;</strong></p>\n<p>\n	Ở&nbsp;Việt Nam,&nbsp;c&aacute;c website được x&acirc;y dựng mới từng ng&agrave;y nhưng rất &iacute;t chủ nh&acirc;n website quan t&acirc;m đến việc Quảng B&aacute; Website (SEO) tr&ecirc;n c&aacute;c bộ m&aacute;y t&igrave;m kiếm ch&iacute;nh&nbsp;như Google, Yahoo, MSN... để mọi người dễ d&agrave;ng t&igrave;m thấy website của họ. Khi website của bạn c&oacute; thứ hạng cao tr&ecirc;n c&aacute;c bộ m&aacute;y t&igrave;m kiếm, website của bạn sẽ &acirc;m thầm mang lại cho bạn những vị kh&aacute;ch h&agrave;ng mới một c&aacute;ch nhanh ch&oacute;ng v&agrave; hiệu quả.<br />\n	<strong><br />\n	C&aacute;c thuật ngữ Quảng b&aacute; website - Tăng thứ hạng Google bạn n&ecirc;n biết:</strong></p>\n<p style=\"text-align: justify;\">\n	<strong>Bộ m&aacute;y t&igrave;m kiếm l&agrave; g&igrave;?</strong></p>\n<ul>\n	<li>\n		Đ&acirc;y l&agrave; từ tạm dịch cụm từ &quot;search engine&quot;. Khi n&oacute;i tới bộ m&aacute;y t&igrave;m kiếm, ta thường nghĩ ngay đến c&aacute;c dịch vụ nổi tiếng như Google Search, Yahoo! Search hay MSN Search, v.v&hellip; Tuy nhi&ecirc;n, bộ phận t&igrave;m kiếm trong một website cụ thể cũng được coi l&agrave; Search Engine.</li>\n</ul>\n<p style=\"text-align: justify;\">\n	<strong>Từ kh&oacute;a l&agrave; g&igrave;?</strong></p>\n<ul>\n	<li>\n		Từ kh&oacute;a l&agrave; những từ d&ugrave;ng để chỉ nội dung, t&iacute;nh chất, ng&agrave;nh nghề kinh doanh hay dịch vụ của website. Khi bạn muốn t&igrave;m một th&ocirc;ng tin n&agrave;o đ&oacute;, v&agrave; bạn ngồi trước cửa sổ t&igrave;m kiếm của Google, bạn sẽ l&agrave;m g&igrave;? Chắc chắn bạn sẽ đ&aacute;nh c&aacute;c từ c&oacute; &yacute; nghĩa ch&iacute;nh với nội dung m&agrave; bạn muốn t&igrave;m. c&aacute;c từ c&oacute; &yacute; nghĩa ch&iacute;nh với nội dung m&agrave; bạn muốn t&igrave;m, đ&oacute; l&agrave; từ kh&oacute;a!</li>\n</ul>\n<p style=\"text-align: justify;\">\n	<strong>Top 10 l&agrave; g&igrave;?</strong></p>\n<ul>\n	<li>\n		L&agrave; để chỉ website của bạn c&oacute; mặt từ 1 đến 10 trong trang đầu ti&ecirc;n của c&aacute;c trang kết quả trả về từ c&aacute;c bộ m&aacute;y t&igrave;m kếm.</li>\n</ul>\n<p style=\"text-align: justify;\">\n	<strong>Tại sao phải Quảng b&aacute; website - Tăng thứ hạng Google&nbsp;(SEO)?</strong></p>\n<ul>\n	<li>\n		Th&ocirc;ng thường, bạn cần mua một sản phẩm n&agrave;o đ&oacute; m&agrave; chưa biết nơi cung cấp bạn sẽ l&ecirc;n c&aacute;c trang t&igrave;m kiếm như google, yahoo &amp; msn để t&igrave;m th&ocirc;ng tin. Bạn c&oacute; thể truy vấn c&aacute;c th&ocirc;ng tin đ&oacute; bằng c&aacute;ch nhập v&agrave;o c&aacute;c từ kh&oacute;a, v&iacute; dụ:&nbsp;nh&agrave; h&agrave;ng&nbsp;để t&igrave;m&nbsp;c&aacute;c nh&agrave; h&agrave;ng ở Việt Nam.</li>\n	<li>\n		Do đ&oacute;, C&ocirc;ng ty c&aacute;c bạn&nbsp;c&oacute; thể t&igrave;m kiếm kh&aacute;ch h&agrave;ng tiềm năng từ c&aacute;ch tr&ecirc;n, nhưng website của c&aacute;c bạn phải nằm trong top 10 (nằm trong trang đầu ti&ecirc;n) th&igrave; mới c&oacute; thể được người&nbsp;t&igrave;m kiếm th&ocirc;ng tin xem qua sản phẩm, dịch vụ&nbsp;ở website của&nbsp;bạn. Nếu website bạn tốt, sản phẩm đẹp, gi&aacute; cả hợp l&yacute; th&igrave; kh&aacute;ch h&agrave;ng sẽ li&ecirc;n hệ với bạn để mua sản phẩm hay sử dụng&nbsp;dịch vụ của bạn.</li>\n	<li>\n		Website của bạn sẽ dần bị cộng đồng mạng qu&ecirc;n l&atilde;ng nếu kh&ocirc;ng được quảng b&aacute; rộng r&atilde;i. Quảng b&aacute; website bằng SEO sẽ mang dịch vụ, sản phẩm của bạn đến đ&uacute;ng với người c&oacute; nhu cầu khi họ t&igrave;m tr&ecirc;n Google, Yahoo, MSN...</li>\n</ul>\n<p style=\"text-align: justify;\">\n	<strong>Dịch vụ Quảng b&aacute; website - Tăng thứ hạng Google của thiết kế web :</strong></p>\n<ul>\n	<li>\n		Ch&uacute;ng t&ocirc;i quảng b&aacute; website với c&aacute;c bộ m&aacute;y t&igrave;m kiếm ch&iacute;nh l&agrave; Google, Yahoo v&agrave; MSN. Khi t&igrave;m với c&aacute;c từ kh&oacute;a c&oacute; li&ecirc;n quan đến ng&agrave;nh nghề kinh doanh của bạn th&igrave; website của bạn c&oacute; mặt trong top 10 (trang đầu ti&ecirc;n). Ch&uacute;ng t&ocirc;i sẽ tư vấn để c&aacute;c bạn c&oacute; được những từ kh&oacute;a hiệu quả nhất. Ch&uacute;ng t&ocirc;i cam kết ho&agrave;n lại 100% chi ph&iacute; nếu ch&uacute;ng t&ocirc;i kh&ocirc;ng thực hiện được những thỏa thuận trong hợp đồng k&yacute; kết.</li>\n</ul>\n<p style=\"text-align: justify;\">\n	<strong><br />\n	Chi ph&iacute; cho việc tối ưu website của bạn phụ thuộc v&agrave;o nhiều yếu tố:</strong></p>\n<ul>\n	<li style=\"text-align: justify;\">\n		Nội dung, bố cục của website bạn.</li>\n	<li style=\"text-align: justify;\">\n		Ngh&agrave;nh nghề hay sản phẩm bạn đang kinh doanh.</li>\n	<li style=\"text-align: justify;\">\n		C&aacute;c đối thủ cạnh tranh với doanh nghiệp của bạn (qua website).</li>\n</ul>\n<p style=\"text-align: justify;\">\n	<strong><br />\n	C&aacute;c hoạt động Quảng b&aacute; website - Tăng thứ hạng Google:</strong></p>\n<ul>\n	<li style=\"text-align: justify;\">\n		Kiểm định chất lượng website, chỉnh sửa c&aacute;c thẻ HTML, CSS để website th&acirc;n thiện với c&aacute;c search engine hơn.</li>\n	<li style=\"text-align: justify;\">\n		Lập tr&igrave;nh c&aacute;c&nbsp;tập robot.</li>\n	<li style=\"text-align: justify;\">\n		Lập tr&igrave;nh c&aacute;c tập tin .xml.</li>\n	<li style=\"text-align: justify;\">\n		Đăng k&yacute; website v&agrave;o c&aacute;c search engine ch&iacute;nh như Google, Yahoo, MSN,...</li>\n	<li style=\"text-align: justify;\">\n		Đăng k&yacute; website v&agrave;o c&aacute;c danh bạ website.</li>\n	<li style=\"text-align: justify;\">\n		Trao đổi li&ecirc;n kết với c&aacute;c website kh&aacute;c.</li>\n	<li style=\"text-align: justify;\">\n		Tạo c&aacute;c mạng x&atilde; hội, blog, forum</li>\n	<li style=\"text-align: justify;\">\n		Đặc biệt, ch&uacute;ng t&ocirc;i c&oacute; c&ocirc;ng nghệ quảng b&aacute; website ri&ecirc;ng, do ch&iacute;nh ch&uacute;ng t&ocirc;i x&acirc;y dựng v&agrave; ph&aacute;t triển.</li>\n</ul>\n', 'SEO, dịch vụ SEO web chuyên nghiệp', 'SEO, dịch vụ SEO web chuyên nghiệp');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8225, 46, '', 'Bí quyết thành công hơn trong công việc và cuộc sống', '<p style=\"text-align: justify;\">\n	<strong>Ch&uacute;ng ta ai cũng hi vọng m&igrave;nh th&agrave;nh c&ocirc;ng trong sự nghiệp nhưng kh&ocirc;ng phải l&uacute;c n&agrave;o cũng được như &yacute; muốn. Nhiều người l&agrave;m việc với th&aacute;i độ hời hợt, kh&ocirc;ng cố gắng kh&ocirc;ng hết m&igrave;nh nhưng l&uacute;c n&agrave;o cũng muốn được đề bạt, thăng chức, tăng lương. Tuy nhi&ecirc;n họ kh&ocirc;ng đạt được điều đ&oacute; v&igrave; th&aacute;i đ&ocirc; l&agrave;m việc của m&igrave;nh. Bạn h&atilde;y học những &ldquo; kỹ năng mềm&rdquo; sau đ&acirc;y để th&agrave;nh c&ocirc;ng trong c&ocirc;ng việc:</strong></p>\n<p style=\"text-align: justify;\">\n	<strong style=\"text-align: justify;\">L&agrave;m việc với tất cả tấm l&ograve;ng</strong><span style=\"text-align: justify;\">&nbsp;&ndash;&nbsp;chỉ khi bạn d&agrave;nh hết t&acirc;m huyết cho c&ocirc;ng việc th&igrave; hiệu quả l&agrave;m việc của bạn mới đạt được năng suất cao nhất. Th&aacute;i độ l&agrave;m việc kh&ocirc;ng phải l&agrave; thứ dễ h&igrave;nh th&agrave;nh v&agrave; ai cũng c&oacute; th&aacute;i đ&ocirc; l&agrave;m việc nghi&ecirc;m t&uacute;c, chăm chỉ. Nếu bạn hời hợt v&agrave; xem c&ocirc;ng việc c&ocirc;ng ty l&agrave; của mọi người th&igrave; chẳng bao giờ bạn c&oacute; thể l&ecirc;n được chức vụ quản l&yacute; cả. Bởi v&igrave; kh&ocirc;ng một &ocirc;ng chủ n&agrave;o lại giao c&ocirc;ng ty của m&igrave;nh cho người kh&ocirc;ng hết l&ograve;ng v&igrave; c&ocirc;ng việc!</span></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/475520689419820744-cachtimviecchonguoihuongnoi.jpg\" style=\"text-align: justify;\" /></p>\n<p style=\"text-align: justify;\">\n	<strong>Đừng đứng n&uacute;i n&agrave;y tr&ocirc;ng n&uacute;i nọ</strong>&nbsp;&ndash; th&aacute;i độ chung của kh&aacute; nhiều bạn trẻ, c&aacute;c bạn mới ra trường nhưng lại muốn l&agrave;m việc ở những vị tr&iacute; cao, then chốt m&agrave; những người xuất sắc phải hết m&igrave;nh với c&ocirc;ng việc mới được nắm giữ. Vừa mới ra trường, bước v&agrave; m&ocirc;i trường c&ocirc;ng sở c&aacute;c bạn kh&ocirc;ng l&agrave;m việc để n&acirc;ng cao nặng lực v&agrave; trau dồi kinh nghiệm, ngược lại lu&ocirc;n đứng n&uacute;i n&agrave;y tr&ocirc;ng n&uacute;i nọ! Nếu nh&igrave;n thấy c&ocirc;ng ty kh&aacute;c c&oacute; lương hấp dẫn hơn, điều kiện l&agrave;m việc tốt hơn c&aacute;c bạn kh&ocirc;ng ngại ngần nhảy việc! Điều n&agrave;y kh&ocirc;ng tốt cho c&aacute;c bạn ch&uacute;t n&agrave;o cả. Bạn biết trước khi leo đến những bậc thang cao nhất, bạn phải khởi đầu từ những bậc thấp nhất m&agrave;, phải kh&ocirc;ng? Trước ti&ecirc;n h&atilde;y l&agrave;m tốt những việc đơn giản ph&ugrave; hợp với khả năng của m&igrave;nh, khi đ&atilde; hội đủ kinh nghiệm v&agrave; kỹ năng bạn h&atilde;y nghĩ tới việc vươn cao hơn trong sự nghiệp. Nếu kh&ocirc;ng c&oacute; một gốc vững v&agrave;ng, bạn sẽ dễ bị ng&atilde; quỵ tr&ecirc;n con đường c&ocirc;ng danh sự nghiệp đấy. &nbsp;Mặt kh&aacute;c, c&aacute;c c&ocirc;ng ty lớn họ đ&ograve;i hỏi rất cao cả về năng lực v&agrave; tư duy nghề nghiệp, sẽ kh&ocirc;ng dễ d&agrave;ng tuyển dụng những ứng vi&ecirc;n nhảy việc li&ecirc;n tục đ&acirc;u.</p>\n<p style=\"text-align: justify;\">\n	<strong>Thử th&aacute;ch&nbsp; những c&ocirc;ng việc ngo&agrave;i khả năng</strong>&nbsp;&ndash; điều n&agrave;y sẽ gi&uacute;p &iacute;ch cho bạn rất nhiều, bạn sẽ kh&aacute;m ph&aacute; th&ecirc;m được những khả năng tiềm ẩn của bản th&acirc;n đồng thời n&acirc;ng cao kỹ năng nghề nghiệp. Nếu gặp phải kh&oacute;c khăn h&atilde;y nhờ những người giỏi về lĩnh vực bạn đang phụ tr&aacute;ch hướng dẫn th&ecirc;m cho bạn. Th&ocirc;ng thường, ch&uacute;ng ta rất ngại khi phải l&agrave;m những việc ngo&agrave;i khả năng của m&igrave;nh bởi ch&uacute;ng ta sợ sẽ thất bại hoặc phạm phải những sai lầm nghi&ecirc;m trọng. Nhưng h&atilde;y bỏ sự sợ h&atilde;i qua một b&ecirc;n v&agrave; l&agrave;m tốt ch&uacute;ng hết mức c&oacute; thể. Con đường sự nghiệp đang tr&atilde;i d&agrave;i trước mắt bạn đấy.</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/1042397476638751963-cogs-and-gears-300x203.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	<strong>Chấp nhận thất bại</strong>&nbsp;&ndash; kh&ocirc;ng phải l&uacute;c n&agrave;o ch&uacute;ng ta cũng th&agrave;nh c&ocirc;ng nếu kh&ocirc;ng biết chấp nhận thất bại chỉ khiến cho ch&uacute;ng ta gặp th&ecirc;m nhiều vấn đề nghi&ecirc;m trọng m&agrave; th&ocirc;i. &Aacute;p lực v&agrave; stress sẽ thường xuy&ecirc;n xảy ra thế n&ecirc;n đừng qu&aacute; đề cao sự th&agrave;nh c&ocirc;ng,&nbsp;kh&ocirc;ng phải th&agrave;nh c&ocirc;ng l&agrave; thước đo của gi&aacute; trị con người, thế n&ecirc;n đừng v&igrave; tham vọng m&agrave; đ&aacute;nh mất khả năng chấp nhận hiện thực. C&oacute; những kh&oacute; khăn ch&uacute;ng ta kh&ocirc;ng thể giải quyết được m&agrave; chỉ chấp nhận n&oacute; được m&agrave; th&ocirc;i. Thế n&ecirc;n đừng sợ h&atilde;i thất bại, nếu kh&ocirc;ng c&oacute; thất bại l&agrave;m sao ch&uacute;ng ta biết th&agrave;nh c&ocirc;ng ngọt ng&agrave;o ra sao?</p>\n<p style=\"text-align: justify;\">\n	<strong>T&igrave;m kiếm những &yacute; tưởng mới</strong>&nbsp;&ndash; l&agrave;m việc kh&ocirc;ng phải l&agrave; tr&igrave;nh tự c&oacute; sẵn m&agrave; cần những &yacute; tưởng mới để gi&uacute;p cho n&oacute; đạt được hiệu quả hơn! Nếu bạn chỉ biết tu&acirc;n theo những quy tắc bất di bất dịch rất c&oacute; thể bạn sẽ chỉ nằm y&ecirc;n ở một vị tr&iacute; nh&acirc;n vi&ecirc;n m&agrave; th&ocirc;i. Nếu muốn vươn cao trong sự nghiệp h&atilde;y biết t&igrave;m kiếm những điều mới mẻ!</p>\n<p style=\"text-align: justify;\">\n	<strong>Th&agrave;nh c&ocirc;ng sẽ mỉm cười với bạn nếu bạn biết c&aacute;ch vượt qua những kh&oacute; khăn trong c&ocirc;ng việc. Đừng ngần ngại nếu bạn muốn thử nghiệm điều g&igrave; đ&oacute;.</strong></p>\n<p style=\"text-align: justify;\">\n	<strong>Vận dụng đủ c&aacute;c nguy&ecirc;n tắc tr&ecirc;n, bạn sẽ thăng tiến!</strong></p>\n', 'Chúng ta ai cũng hi vọng mình thành công trong sự nghiệp nhưng không phải lúc nào cũng được như ý muốn. Bạn hãy học những “ kỹ năng mềm” sau đây để thành công trong công việc', 'Chúng ta ai cũng hi vọng mình thành công trong sự nghiệp nhưng không phải lúc nào cũng được như ý muốn. Bạn hãy học những “ kỹ năng mềm” sau đây để thành công trong công việc');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8235, 56, '', 'Thơ chế tổng hợp trên các trang mạng xã hội của sinh viên', '<p style=\"text-align: justify;\">\n	<strong>Tr&ecirc;n c&aacute;c trang&nbsp;mạng x&atilde; hội, cư d&acirc;n mạng đang truyền tay nhau những b&agrave;i thơ chế n&oacute;i về sinh vi&ecirc;n, vừa h&agrave;i hước, d&iacute; dỏm lại s&acirc;u sắc v&agrave; đ&ocirc;i khi rất cảm động.</strong></p>\n<p style=\"text-align: justify;\">\n	<strong>Thơ chế sinh vi&ecirc;n thất nghiệp.</strong></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/2425664805542467344-1-tong-hop-nhung-bai-tho-che-sinh-vien-hay-nhat-tren-mang-xa-hoi.jpg\" /></p>\n<p style=\"text-align: center;\">\n	Đầu đường X&acirc;y dựng bơm xe</p>\n<p style=\"text-align: center;\">\n	Cuối đường Kinh tế b&aacute;n ch&egrave; đỗ đen</p>\n<p style=\"text-align: center;\">\n	Ngoại thương mời kh&aacute;ch ăn kem</p>\n<p style=\"text-align: center;\">\n	Cạnh anh Nhạc viện thổi k&egrave;n đ&aacute;m ma</p>\n<p style=\"text-align: center;\">\n	Ng&acirc;n h&agrave;ng ngồi dập đ&ocirc; la</p>\n<p style=\"text-align: center;\">\n	In giấy v&agrave;ng m&atilde;, sống qua từng ng&agrave;y</p>\n<p style=\"text-align: center;\">\n	Sư phạm trước t&iacute;nh l&agrave;m thầy</p>\n<p style=\"text-align: center;\">\n	Giờ thay kế to&aacute;n, h&agrave;ng ng&agrave;y t&iacute;nh l&ocirc;.</p>\n<p style=\"text-align: center;\">\n	Điện lực chẳng d&aacute;m b&ocirc; b&ocirc;,</p>\n<p style=\"text-align: center;\">\n	Giờ đang lầm lũi phụ hồ tr&ecirc;n cao.</p>\n<p style=\"text-align: center;\">\n	Lập tr&igrave;nh chả hiểu thế n&agrave;o,</p>\n<p style=\"text-align: center;\">\n	h&agrave;ng tr&agrave; đ&aacute;, thuốc l&agrave;o...cho vui</p>\n<p style=\"text-align: center;\">\n	N&ocirc;ng nghiệp hỏi đến ngậm ng&ugrave;i&quot;</p>\n<p style=\"text-align: center;\">\n	Số em chắc chỉ tiến l&ugrave;i theo tr&acirc;u&quot;</p>\n<p style=\"text-align: center;\">\n	Nh&igrave;n quanh, Thương mại đi đ&acirc;u?</p>\n<p style=\"text-align: center;\">\n	H&oacute;a ra l&agrave; đ&atilde; nhảy t&agrave;u đi bu&ocirc;n...</p>\n<p style=\"text-align: center;\">\n	Ngoại ngữ vẻ mặt tho&aacute;ng buồn</p>\n<p style=\"text-align: center;\">\n	Đang ngồi viết sớ, ki&ecirc;m lu&ocirc;n b&oacute;i b&agrave;i.</p>\n<p style=\"text-align: center;\">\n	B&aacute;o ch&iacute; bu&ocirc;n b&aacute;n ve chai</p>\n<p style=\"text-align: center;\">\n	Giao th&ocirc;ng đi chở thu&ecirc; ngo&agrave;i</p>\n<p style=\"text-align: center;\">\n	Đồng Xu&acirc;n.B&aacute;ch khoa cũng gặp đ&ocirc;i lần</p>\n<p style=\"text-align: center;\">\n	Bu&ocirc;n đồ điện hỏng, kiếm c&acirc;n d&acirc;y đồng</p>\n<p style=\"text-align: center;\">\n	Mỹ thuật th&igrave; đang chổng m&ocirc;ng</p>\n<p style=\"text-align: center;\">\n	Đục khắc bia mộ, cũng mong l&ecirc;n đời</p>\n<p style=\"text-align: center;\">\n	Mỏ địa chất mới hỡi &ocirc;i</p>\n<p style=\"text-align: center;\">\n	S&aacute;ng thồ hai sọt, ch&agrave;o mời mua than</p>\n<p style=\"text-align: center;\">\n	Thuỷ sản c&ocirc;ng việc an nh&agrave;n</p>\n<p style=\"text-align: center;\">\n	S&aacute;ng c&acirc;n mớ c&aacute;, cuối l&agrave;ng ngồi rao...!</p>\n<p style=\"text-align: center;\">\n	H&agrave;ng hải ngồi g&aacute;c ch&acirc;n cao</p>\n<p style=\"text-align: center;\">\n	bao&nbsp;giờ tr&uacute;ng số mua t&agrave;u ra khơi</p>\n<p style=\"text-align: center;\">\n	B&aacute;c sĩ, y t&aacute; c&oacute; thời</p>\n<p style=\"text-align: center;\">\n	Học xong về huyện được mời ch&iacute;ch heo...</p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: justify;\">\n	<strong>Học Thầy</strong></p>\n<p style=\"text-align: center;\">\n	Kh&ocirc;ng m&agrave;y đố thầy dạy ai&nbsp;</p>\n<p style=\"text-align: center;\">\n	Ti&ecirc;n học lễ hậu học ...ăn&nbsp;</p>\n<p style=\"text-align: center;\">\n	Học đi đ&ocirc;i với h&agrave;nh ,h&agrave;nh đi đ&ocirc;i với tỏi&nbsp;</p>\n<p style=\"text-align: center;\">\n	N&oacute;i tiếng anh như gi&oacute;, gặp từ kh&oacute; ta... bắn sang tiếng Việt.&nbsp;</p>\n<p style=\"text-align: center;\">\n	Học, học nữa, học m&atilde;i, đ&uacute;p... học tiếp!!!&nbsp;</p>\n<p style=\"text-align: center;\">\n	Học, học nữa, hộc m&aacute;u.&nbsp;</p>\n<p style=\"text-align: center;\">\n	Học kh&ocirc;ng y&ecirc;u yếu dần rồi chết</p>\n<p style=\"text-align: center;\">\n	Y&ecirc;u kh&ocirc;ng học kh&ocirc;ng ng&oacute;c được l&ecirc;n&nbsp;</p>\n<p style=\"text-align: center;\">\n	Học l&agrave;m chi, thi l&agrave;m g&igrave;</p>\n<p style=\"text-align: center;\">\n	T&uacute; Xương c&ograve;n rớt,huống chi l&agrave; m&igrave;nh&nbsp;</p>\n<p style=\"text-align: center;\">\n	Gi&aacute;m thị nh&igrave;n em gi&aacute;m thị cười - Em nh&igrave;n gi&aacute;m thị lệ tu&ocirc;n rơi&nbsp;</p>\n<p style=\"text-align: center;\">\n	Cỗng trường đại học cao vời vợi - Đồng ruộng m&ecirc;nh m&ocirc;ng đ&oacute;n em về&nbsp;</p>\n<p style=\"text-align: center;\">\n	Học tr&ograve; ng&agrave;y nay quậy tới trời</p>\n<p style=\"text-align: center;\">\n	10 thằng đi học 9 thằng chơi</p>\n<p style=\"text-align: center;\">\n	3 thằng đến lớp 2 thằng ngủ</p>\n<p style=\"text-align: center;\">\n	C&ograve;n lại thằng kia cũng gật g&ugrave;</p>\n<p style=\"text-align: center;\">\n	&nbsp;Học cho lắm tắm hổng c&oacute; quần thay</p>\n<p style=\"text-align: center;\">\n	Học cho hay tắm thay ho&agrave;i c&aacute;i quần cũ.</p>\n<p style=\"text-align: center;\">\n	&nbsp;Học cho lắm cũng ăn mắm với c&agrave;</p>\n<p style=\"text-align: center;\">\n	Học t&agrave; t&agrave; cũng ăn c&agrave; với mắm</p>\n<p style=\"text-align: center;\">\n	Học cho lắm cũng đi tắm cởi truồng</p>\n<p style=\"text-align: center;\">\n	Học luồn xuồn cũng cởi truồng đi tắm</p>\n<p style=\"text-align: center;\">\n	&nbsp;Bắt đầu ngủ giữa tiết 3</p>\n<p style=\"text-align: center;\">\n	Đến khi tỉnh giấc đ&atilde; l&agrave; tiết 5&nbsp;</p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: justify;\">\n	<strong>Thơ chế &quot;Truyện Kiều&quot;</strong></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/2307725496975698777-13-tong-hop-nhung-bai-tho-che-sinh-vien-hay-nhat-tren-mang-xa-hoi.jpg\" /></p>\n<p style=\"text-align: center;\">\n	&nbsp;Trăm năm trong c&otilde;i người ta</p>\n<p style=\"text-align: center;\">\n	Nguyễn Du được gọi l&agrave; cha truyện Kiều</p>\n<p style=\"text-align: center;\">\n	Đọc xong Anh thấy đăm chi&ecirc;u</p>\n<p style=\"text-align: center;\">\n	V&igrave; Du đ&atilde; viết rất nhiều điều sai</p>\n<p style=\"text-align: center;\">\n	Người tốt th&igrave; hay bị die...</p>\n<p style=\"text-align: center;\">\n	Đầu l&ograve;ng 2 ả tố nga</p>\n<p style=\"text-align: center;\">\n	Th&uacute;y Kiều l&agrave; chị hay cười ha ha</p>\n<p style=\"text-align: center;\">\n	Th&uacute;y V&acirc;n bản t&iacute;nh thối tha</p>\n<p style=\"text-align: center;\">\n	Lu&ocirc;n lu&ocirc;n đấu đ&aacute; muốn l&agrave; chị cơ</p>\n<p style=\"text-align: center;\">\n	Th&uacute;y Kiều mệt mỏi bơ phờ</p>\n<p style=\"text-align: center;\">\n	N&ecirc;n đ&agrave;nh nhẫn nhịn : &quot; Th&ocirc;i ờ tao thua &quot;</p>\n<p style=\"text-align: center;\">\n	V&acirc;n sướng : &quot; Tao thắng l&agrave;m vua</p>\n<p style=\"text-align: center;\">\n	C&ograve;n m&agrave;y bại trận l&agrave;m cua trong nồi&quot;</p>\n<p style=\"text-align: center;\">\n	Th&uacute;y Kiều tức giận : &quot; Đồ tồi&quot;</p>\n<p style=\"text-align: center;\">\n	Th&uacute;y V&acirc;n vừa c&uacute; vừa cay</p>\n<p style=\"text-align: center;\">\n	Nhặt dao , lao tới , ch&eacute;m bay c&aacute;i đầu</p>\n<p style=\"text-align: center;\">\n	Kiều ta c&ograve;n mỗi đầu l&acirc;u</p>\n<p style=\"text-align: center;\">\n	Mất th&acirc;n , đ&agrave;nh kiếm x&agrave; m&acirc;u cắm v&agrave;o</p>\n<p style=\"text-align: center;\">\n	Th&uacute;y V&acirc;n sợ qu&aacute; th&agrave;nh đao</p>\n<p style=\"text-align: center;\">\n	Cha mẹ thấy thế gửi v&agrave;o lầu xanh.</p>\n<p style=\"text-align: center;\">\n	B&aacute;n th&acirc;n mới được 1 tuần</p>\n<p style=\"text-align: center;\">\n	V&acirc;n kiếm được kẻ chuộc th&acirc;n cho m&igrave;nh</p>\n<p style=\"text-align: center;\">\n	Ch&agrave;ng t&ecirc;n l&agrave; M&atilde; Gi&aacute;m Sinh</p>\n<p style=\"text-align: center;\">\n	Xuất th&acirc;n từ chốn V&otilde; L&acirc;m Truyền K&igrave;</p>\n<p style=\"text-align: center;\">\n	Thanh ni&ecirc;n trai tr&aacute;ng đ&ocirc;i mươi</p>\n<p style=\"text-align: center;\">\n	Nhiều t&agrave;i lắm của l&agrave; người đẹp trai</p>\n<p style=\"text-align: center;\">\n	C&ograve; k&egrave; bớt 1 th&ecirc;m 2</p>\n<p style=\"text-align: center;\">\n	Giờ l&acirc;u ng&atilde; gi&aacute; v&agrave;ng ngo&agrave;i 4 trăm</p>\n<p style=\"text-align: center;\">\n	Th&uacute;y V&acirc;n tuổi mới 15</p>\n<p style=\"text-align: center;\">\n	L&agrave; g&aacute;i sung sức ăn nằm rất ph&ecirc;</p>\n<p style=\"text-align: center;\">\n	Kiệu to đến rước V&acirc;n về</p>\n<p style=\"text-align: center;\">\n	Nghĩ tới kho&aacute;i lạc sướng t&ecirc; cả người</p>\n<p style=\"text-align: center;\">\n	Quản gia đ&oacute;n kiệu tươi cười</p>\n<p style=\"text-align: center;\">\n	Th&acirc;n l&ugrave;n tr&aacute;n h&oacute;i l&agrave; người rất th&acirc;m</p>\n<p style=\"text-align: center;\">\n	Quản gia t&ecirc;n gọi Th&uacute;c Sinh</p>\n<p style=\"text-align: center;\">\n	Đi c&ugrave;ng với vợ l&agrave; Đ&igrave;nh Hoạn Thư</p>\n<p style=\"text-align: center;\">\n	Hoạn Thư yểu điệu hiền từ</p>\n<p style=\"text-align: center;\">\n	Do được gi&aacute;o dục bởi sư trong đền</p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: justify;\">\n	<strong>Thơ chế &quot;Qua đ&egrave;o ngang&quot;</strong></p>\n<p style=\"text-align: center;\">\n	Bước tới h&agrave;ng game b&oacute;ng xế t&agrave;.</p>\n<p style=\"text-align: center;\">\n	Người đ&ocirc;ng chen mất lối đi ra.</p>\n<p style=\"text-align: center;\">\n	Lom khom v&agrave;i ch&uacute; ngồi săn boss.</p>\n<p style=\"text-align: center;\">\n	L&aacute;c đ&aacute;c b&ecirc;n trong mấy lũ g&agrave;.</p>\n<p style=\"text-align: center;\">\n	Nhớ x&atilde; đau l&ograve;ng đấu Beat-Up.</p>\n<p style=\"text-align: center;\">\n	Thương bạn đ&agrave;nh ngồi nhảy 8k.</p>\n<p style=\"text-align: center;\">\n	Dừng tay bấm lại ngồi suy ngẫm.</p>\n<p style=\"text-align: center;\">\n	Một m&igrave;nh một room ta với ta</p>\n<p style=\"text-align: center;\">\n	.........................................</p>\n<p style=\"text-align: center;\">\n	Trong ph&ograve;ng ko nhạc cũng ko loa.</p>\n<p style=\"text-align: center;\">\n	Một lũ nghiệp dư, một lũ g&agrave;</p>\n<p style=\"text-align: center;\">\n	.Ri&ecirc;ng ta vỡ l&ograve;ng chấp tất cả.</p>\n<p style=\"text-align: center;\">\n	Hết trận chạy cả, c&ograve;n m&igrave;nh ta</p>\n<p style=\"text-align: center;\">\n	.........................................</p>\n<p style=\"text-align: center;\">\n	Tiếng h&aacute;t xen trong tiếng m&aacute; la.</p>\n<p style=\"text-align: center;\">\n	8k, nhạc chậm, lớp học ma.</p>\n<p style=\"text-align: center;\">\n	Cảnh au như vẽ người đang nhảy.</p>\n<p style=\"text-align: center;\">\n	Đang nhảy vượt wa c&aacute;i kiếp g&agrave;.</p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: justify;\">\n	<strong>Thơ chế &quot;Kiếp độc th&acirc;n&quot;</strong></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/578909332445172550-6-tong-hop-nhung-bai-tho-che-sinh-vien-hay-nhat-tren-mang-xa-hoi.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	<strong>Thơ chế &quot;Ch&acirc;n ngắn đ&aacute;ng y&ecirc;u&quot;</strong></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/39841009896246569-5-tong-hop-nhung-bai-tho-che-sinh-vien-hay-nhat-tren-mang-xa-hoi.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	<strong>Thơ chế &quot;Sinh vi&ecirc;n bị bồ đ&aacute;&quot;</strong></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/981072404959101233-8-tong-hop-nhung-bai-tho-che-sinh-vien-hay-nhat-tren-mang-xa-hoi.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	<strong>Thơ chế &quot;Sinh vi&ecirc;n ngh&egrave;o&quot;</strong></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/1218682160226714492-7-tong-hop-nhung-bai-tho-che-sinh-vien-hay-nhat-tren-mang-xa-hoi.jpg\" /></p>\n<p style=\"text-align: justify;\">\n	<strong>Đơn xin nghỉ học si&ecirc;u b&aacute; đạo của sinh vi&ecirc;n</strong></p>\n<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/555874924125995026-14-tong-hop-nhung-bai-tho-che-sinh-vien-hay-nhat-tren-mang-xa-hoi.jpg\" /></p>\n', 'Trên các trang mạng xã hội, cư dân mạng đang truyền tay nhau những bài thơ chế nói về sinh viên, vừa hài hước, dí dỏm lại sâu sắc và đôi khi rất cảm động.', 'Trên các trang mạng xã hội, cư dân mạng đang truyền tay nhau những bài thơ chế nói về sinh viên, vừa hài hước, dí dỏm lại sâu sắc và đôi khi rất cảm động.');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8237, 58, '', 'Tóm lại là có mấy con gấu? đố bạn biết', '<p style=\"text-align: center;\">\n	<img src=\"http://happycard.vn/images/news/494902331275496019-dong-vat-hai-huoc-.gif\" /></p>\n<p style=\"text-align: center;\">\n	T&oacute;m lại l&agrave; c&oacute; mấy con gấu? đố bạn biết...thiệt l&agrave; ch&oacute;ng hết cả mặt</p>\n', 'Tóm lại là có mấy con gấu? đố bạn biết...thiệt là chóng hết cả mặt', 'Tóm lại là có mấy con gấu? đố bạn biết...thiệt là chóng hết cả mặt');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8240, 61, '', 'Phong thủy theo Tứ tượng: Thanh Long, Bạch Hổ, Huyền Vũ và Chu Tước.', '<h2>\n	Phong thủy kinh điển sử dụng những h&igrave;nh ảnh đầy m&agrave;u sắc để m&ocirc; tả một thế đất đẹp, đ&oacute; l&agrave; khu đất hội tụ Tứ tượng: Thanh Long, Bạch Hổ, Huyền Vũ v&agrave; Chu Tước.</h2>\n<div id=\"divcontent\">\n	<p>\n		Tứ Tượng hay tứ th&aacute;nh th&uacute; l&agrave; một kh&aacute;i niệm h&igrave;nh tượng trong triết học phương Đ&ocirc;ng, tượng trưng cho c&aacute;c con th&uacute; thi&ecirc;ng trong c&aacute;c ch&ograve;m sao Trung Hoa cổ đại: Huyền Vũ của phương Bắc, Thanh Long của phương Đ&ocirc;ng, Bạch Hổ của phương T&acirc;y v&agrave; Chu Tước của phương Nam.</p>\n	<p>\n		&nbsp;</p>\n	<div>\n		<div style=\"text-align: center;\">\n			<img src=\"http://happycard.vn/images/news/1872790933722808091-tutuongtrongphongthuyhiendai1.jpg\" /></div>\n		<div>\n			<center>\n				&nbsp;</center>\n		</div>\n		<div>\n			&nbsp;</div>\n		<div>\n			H&igrave;nh thế n&uacute;i cao ba bề gợi cho ta nhớ tới một chiếc &ldquo;ghế b&agrave;nh&rdquo;, biểu tượng của cuộc sống tiện nghi.</div>\n	</div>\n	<p>\n		Thế đất Tứ Tượng bao gồm:</p>\n	<div>\n		&nbsp;- Huyền Vũ (r&ugrave;a đen) l&agrave; tr&aacute;i n&uacute;i ph&iacute;a sau ng&ocirc;i nh&agrave;, l&yacute; tưởng nhất l&agrave; nằm ở phương Bắc.</div>\n	<p>\n		- Thanh Long (rồng xanh) l&agrave; ngọn đồi ph&iacute;a tay tr&aacute;i ng&ocirc;i nh&agrave;, tốt nhất l&agrave; nằm ở phương Đ&ocirc;ng.</p>\n	<p>\n		- Bạch Hổ (hổ trắng) l&agrave; ngọn đồi ph&iacute;a tay phải ng&ocirc;i nh&agrave;, n&oacute; phải thấp hơn đồi Thanh Long b&ecirc;n tr&aacute;i v&agrave; n&uacute;i Huyền Vũ sau nh&agrave;.</p>\n	<div>\n		<p>\n			- Chu Tước (chim sẻ đỏ) l&agrave; g&ograve; đồi nhỏ trước mặt nh&agrave;, l&yacute; tưởng nhất l&agrave; ở phương Nam.</p>\n		<p style=\"text-align: center;\">\n			<br />\n			<br />\n			<img src=\"http://happycard.vn/images/news/3385950719791838494-tutuongtrongphongthuyhiendai2.jpg\" /></p>\n		<div>\n			<center>\n				&nbsp;</center>\n		</div>\n	</div>\n	<p>\n		Nếu đứng từ trong nh&agrave; nh&igrave;n ra, Thanh Long ở b&ecirc;n tr&aacute;i, Bạch Hổ b&ecirc;n phải, Huyền Vũ ở sau v&agrave; Chu Tước ở trước.</p>\n	<p>\n		Phong thủy h&igrave;nh thế dựa chủ yếu v&agrave;o thế đất xung quanh ng&ocirc;i nh&agrave;. Thế giới hiện đại đ&atilde; kh&aacute;c xa thế giới của người xưa, cảnh quan thay đổi qu&aacute; nhiều. C&aacute;c th&agrave;nh phố đ&ocirc;ng đ&uacute;c với những khu chung cư san s&aacute;t mọc l&ecirc;n khiến người ta phải thay đổi c&aacute;ch luận giải v&agrave; &aacute;p dụng l&yacute; thuyết phong thủy. Những t&ograve;a nh&agrave; cao tầng được xem như n&uacute;i, đường cao tốc được nh&igrave;n nhận như s&ocirc;ng. H&igrave;nh thế của c&aacute;c căn hộ chung cư được x&aacute;c định dựa theo vị tr&iacute; của to&agrave;n bộ t&ograve;a nh&agrave;.</p>\n	<div>\n		Trong phong thủy hiện đại, thật kh&oacute; t&igrave;m được thế Tứ Tượng l&yacute; tưởng. Tuy nhi&ecirc;n, c&aacute;c biện ph&aacute;p sau đ&acirc;y c&oacute; thể gi&uacute;p bạn cải thiện phong thủy h&igrave;nh thế nơi bạn ở.</div>\n	<div>\n		<br />\n		- Huyền Vũ: Nền đất ph&iacute;a sau nh&agrave; phải cao hơn nền ph&iacute;a trước nh&agrave;. X&acirc;y một ụ đất giống như lưng r&ugrave;a để tạo Huyền Vũ. L&yacute; tưởng nhất l&agrave; Huyền Vũ nằm ở phương Bắc của ng&ocirc;i nh&agrave;.<br />\n		<div>\n			&nbsp;</div>\n	</div>\n	<center>\n		<img src=\"http://happycard.vn/images/news/136072725715820394-tutuongtrongphongthuyhiendai3.jpg\" /></center>\n	<p style=\"text-align: center;\">\n		<span style=\"color:#f00;\">R&ugrave;a đen<br />\n		</span></p>\n	<p>\n		Nếu kh&ocirc;ng c&oacute; c&aacute;ch n&agrave;o tạo được m&ocirc; đất n&oacute;i tr&ecirc;n, h&atilde;y treo một bức tranh r&ugrave;a ở phần sau của ng&ocirc;i nh&agrave;, hoặc tốt hơn nữa th&igrave; nu&ocirc;i r&ugrave;a ở vị tr&iacute; n&agrave;y. Nu&ocirc;i một con l&agrave; đủ v&igrave; con số gắn với r&ugrave;a l&agrave; số 1.</p>\n	<div>\n		R&ugrave;a được cho l&agrave; c&oacute; thể mang lại vận may qu&yacute; nh&acirc;n ph&ugrave; trợ, sự trường thọ cũng như sự bảo vệ l&acirc;u bền. Nếu kh&ocirc;ng c&oacute; điều kiện nu&ocirc;i r&ugrave;a th&igrave; đặt một tượng r&ugrave;a bằng đ&aacute; hoặc bằng đồng cũng rất tốt. K&iacute;ch hoạt Huyền Vũ l&agrave; một trong những biện ph&aacute;p quan trọng trong phong thủy.</div>\n	<div>\n		- Thanh Long: Rồng l&agrave; biểu tượng mang lại may mắn. Trong phong thủy h&igrave;nh thế, việc chọn được thế đất nhấp nh&ocirc;, nơi rồng tr&uacute; ẩn, được coi l&agrave; hết sức tốt l&agrave;nh. Nh&igrave;n từ trong ra ngo&agrave;i, đồi Thanh Long nằm b&ecirc;n tr&aacute;i ng&ocirc;i nh&agrave;. N&ecirc;n bố tr&iacute; để thế đất b&ecirc;n tr&aacute;i cao hơn b&ecirc;n phải.</div>\n	<div>\n		&nbsp;</div>\n	<div>\n		<div>\n			<center>\n				<img src=\"http://happycard.vn/images/news/1948196132464190018-tutuongtrongphongthuyhiendai4.jpg\" /></center>\n		</div>\n		<div style=\"text-align: center;\">\n			<span style=\"color:#f00;\">&nbsp;&nbsp;&nbsp;&nbsp;Rồng 4 m&oacute;ng&nbsp; &nbsp;</span></div>\n		<div style=\"text-align: center;\">\n			<span style=\"color:#f00;\"><br />\n			&nbsp;</span><img src=\"http://happycard.vn/images/news/1447270036936941326-tutuongtrongphongthuyhiendai5.jpg\" /></div>\n		<div>\n			<center>\n				<span style=\"color:#f00;\">Rồng 5 m&oacute;ng</span></center>\n		</div>\n	</div>\n	<p>\n		Rồng tr&uacute; ngụ ở phương Đ&ocirc;ng. Nếu bạn kh&ocirc;ng c&oacute; điều kiện thay đổi m&ocirc;i trường b&ecirc;n ngo&agrave;i th&igrave; c&oacute; thể treo ảnh rồng tr&ecirc;n bức tường ph&iacute;a Đ&ocirc;ng ng&ocirc;i nh&agrave; hoặc đặt tượng rồng ở ph&iacute;a Đ&ocirc;ng ph&ograve;ng kh&aacute;ch.</p>\n	<p>\n		N&ecirc;n chọn rồng bốn m&oacute;ng, tr&aacute;nh rồng năm m&oacute;ng (chỉ d&ugrave;ng cho vua ch&uacute;a), v&igrave; mức năng lượng qu&aacute; lớn do rồng năm m&oacute;ng tạo ra c&oacute; thể kh&ocirc;ng ph&ugrave; hợp với bạn.</p>\n	<p>\n		- Bạch Hổ: M&atilde;nh th&uacute; n&agrave;y cũng quan trọng kh&ocirc;ng k&eacute;m Rồng. Thanh long tạo ra cuộc sống tốt đẹp c&ograve;n Bạch hổ lại gi&uacute;p duy tr&igrave; cuộc sống n&agrave;y. Đồi Bạch Hổ nằm b&ecirc;n phải ng&ocirc;i nh&agrave; v&agrave; nhất thiết phải thấp hơn đồi Thanh Long.</p>\n	<div>\n		<p>\n			Người ta tin rằng nếu thế đất b&ecirc;n phải cao hơn, Bạch Hổ mạnh hơn sẽ lấn &aacute;t Thanh Long. Điều n&agrave;y cực kỳ nguy hiểm v&igrave; Hổ dữ c&oacute; thể g&acirc;y hại cho những người sống trong nh&agrave;.</p>\n		<p>\n			&nbsp;</p>\n		<div>\n			<center>\n				<img src=\"http://happycard.vn/images/news/2522317120026614439-tutuongtrongphongthuyhiendai6.jpg\" /></center>\n		</div>\n	</div>\n	<p style=\"text-align: center;\">\n		<span style=\"color:#f00;\">Bạch Hổ</span></p>\n	<div>\n		<p>\n			- Chu Tước: Chim đỏ l&agrave; biểu tượng của phương nam hay khoảng đất trống ph&iacute;a mặt tiền ng&ocirc;i nh&agrave;. Khu vực n&agrave;y cần bằng phẳng, hoặc &iacute;t nhất l&agrave; thấp hơn đất đằng sau, b&ecirc;n tr&aacute;i v&agrave; b&ecirc;n phải nh&agrave;. Chu Tước được cho l&agrave; mang lại cơ hội tiền t&agrave;i vật chất.</p>\n		<br />\n		<div>\n			<center>\n				<img src=\"http://happycard.vn/images/news/2744352212376747242-tutuongtrongphongthuyhiendai7.jpg\" /></center>\n		</div>\n	</div>\n	<p>\n		Treo tranh hoặc đặt tượng g&agrave; ở ph&iacute;a Nam ph&ograve;ng kh&aacute;ch để k&iacute;ch hoạt Chu Tước.</p>\n	<div>\n		Vật lớn chặn trước ng&ocirc;i nh&agrave; được xem như trở ngại với những c&ocirc;ng việc bạn đang thực hiện. Th&agrave;nh c&ocirc;ng sẽ tới một c&aacute;ch kh&oacute; khăn. Tồi hơn nữa bạn c&oacute; thể mất m&aacute;t nặng nề.<br />\n		&nbsp;<br />\n		&nbsp;</div>\n</div>\n<div style=\"text-align: right;\">\n	Theo Ng&ocirc;i sao</div>\n', 'Tứ Tượng hay tứ thánh thú là một khái niệm hình tượng trong triết học phương Đông, tượng trưng cho các con thú thiêng trong các chòm sao Trung Hoa cổ đại: Huyền Vũ của phương Bắc, Thanh Long của phương Đông, Bạch Hổ của phươn', 'Tứ Tượng hay tứ thánh thú là một khái niệm hình tượng trong triết học phương Đông, tượng trưng cho các con thú thiêng trong các chòm sao Trung Hoa cổ đại: Huyền Vũ của phương Bắc, Thanh Long của phương Đông, Bạch Hổ của phươn');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8243, 64, '', 'Lỗ hổng trên IE cho phép hacker theo dõi con trỏ chuột của người dùng', '<div id=\"leadDiv\" style=\"text-align: justify;\">\n	<span style=\"font-size:12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Mới đ&acirc;y, 1 lỗ hổng bảo mật kh&aacute; nghi&ecirc;m trọng đ&atilde; được ph&aacute;t hiện tr&ecirc;n tr&igrave;nh duyệt IE khiến cho người d&ugrave;ng rất lo lắng. Theo đ&oacute;, nhờ lỗ hổng n&agrave;y, hacker c&oacute; thể theo d&otilde;i c&aacute;c thao t&aacute;c của con trỏ chuột m&aacute;y t&iacute;nh người d&ugrave;ng khi họ di con trỏ ở bất k&igrave; vị tr&iacute; n&agrave;o tr&ecirc;n m&agrave;n h&igrave;nh. Mặc d&ugrave; l&agrave; lỗ hổng của tr&igrave;nh duyệt nhưng n&oacute; cho ph&eacute;p hacker theo dấu người d&ugrave;ng ngay cả khi họ kh&ocirc;ng lướt web. Tất cả c&aacute;c phi&ecirc;n bản IE đều bị d&iacute;nh lỗi nguy hiểm n&agrave;y bao gồm IE6, IE7, IE8, IE9, v&agrave; IE10.</span></span></div>\n<div style=\"text-align: justify;\">\n	&nbsp;</div>\n<div style=\"text-align: center;\">\n	<span style=\"font-size:12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" border=\"0\" id=\"mainImage\" src=\"http://www.emsvn.com/upload/defaultsite/9/IE-Bugs1.jpg\" /></span></span></div>\n<p style=\"text-align: justify;\">\n	<span style=\"font-size:12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Lỗ hổng bảo mật n&agrave;y lần đầu ti&ecirc;n được h&atilde;ng bảo mật Spider.io ph&aacute;t hiện c&aacute;ch đ&acirc;y tới v&agrave;i th&aacute;ng v&agrave; h&atilde;ng n&agrave;y c&ocirc;ng bố rộng r&atilde;i th&ocirc;ng tin v&agrave;o hồi đầu th&aacute;ng 10. Spider.io cho biết sau th&ocirc;ng b&aacute;o của họ th&igrave; Microsoft thừa nhận lỗ hổng n&agrave;y l&agrave; c&oacute; thật nhưng g&atilde; khổng lồ phần mềm chưa c&oacute; kế hoạch để tung ra bản patch v&aacute; lỗi ngay.</span></span></p>\n<div style=\"text-align: justify;\">\n	<span style=\"font-size:12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><br />\n	</span></span></div>\n<div>\n	<h1 style=\"text-align: justify;\">\n		<span style=\"font-size:12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Lỗ hổng n&agrave;y l&agrave;m dấy l&ecirc;n 1 nguy cơ m&aacute;y t&iacute;nh người d&ugrave;ng dễ d&agrave;ng bị theo d&otilde;i khi họ sử dụng b&agrave;n ph&iacute;m ảo vốn l&agrave; một phương ph&aacute;p được nhiều người chọn khi nhập số thẻ t&iacute;n dụng, mật khẩu...thay cho b&agrave;n ph&iacute;m vật l&yacute; v&igrave; lo ngại m&aacute;y bị c&agrave;i đặt keylogger.&nbsp;<br />\n		<br />\n		Ngay cả khi bạn kh&ocirc;ng d&ugrave;ng IE, Spider.io cho biết họ vẫn bị theo d&otilde;i c&aacute;c thao t&aacute;c di chuyển trỏ chuột. Spider.io đ&atilde; thực hiện 1 video m&ocirc; tả qu&aacute; tr&igrave;nh n&agrave;y b&ecirc;n dưới. Ta c&oacute; thể thấy ở m&agrave;n h&igrave;nh b&ecirc;n phải, hacker c&oacute; thể biết được bạn vừa d&ugrave;ng trỏ chuột để lựa chọn số điện thoại cho cuộc gọi Skype rất dễ d&agrave;ng:&nbsp;<br />\n		<br />\n		Kẽ hở từ rất dễ bị hacker lợi dụng, bởi ch&uacute;ng chỉ cần mua 1 quảng c&aacute;o hiển thị tr&ecirc;n 1 website bạn gh&eacute; thăm, v&agrave; miễn l&agrave; người d&ugrave;ng đang mở website đ&oacute; (chưa tắt đi, họ chỉ thu nhỏ lại để l&agrave;m c&aacute;c việc kh&aacute;c), mọi thao t&aacute;c di trỏ của họ đều đ&atilde; được ghi lại. Tr&ecirc;n thực tế, Spider.io cho biết lỗ hổng n&agrave;y đ&atilde; được c&aacute;c nh&agrave; quảng c&aacute;o sử dụng. Mặc d&ugrave; kh&ocirc;ng n&ecirc;u t&ecirc;n nhưng h&atilde;ng bảo mật n&agrave;y cho rằng c&oacute; &iacute;t nhất 2 c&ocirc;ng ty quảng c&aacute;o ph&acirc;n t&iacute;ch v&agrave; quảng c&aacute;o hiển thị đ&atilde; d&ugrave;ng c&aacute;ch n&agrave;y để theo d&otilde;i người d&ugrave;ng.&nbsp;<br />\n		<br />\n		Đ&aacute;p lại c&aacute;c c&aacute;o buộc n&agrave;y, Microsoft mới đ&acirc;y đăng đ&agrave;n thừa nhận IE c&oacute; lỗi bảo mật như h&atilde;ng Spider đ&atilde; n&ecirc;u ra, v&agrave; h&atilde;ng đ&atilde; tiến h&agrave;nh điều tra, mặc d&ugrave; cho rằng lỗ hổng n&agrave;y chưa bị khai th&aacute;c để theo d&otilde;i người d&ugrave;ng như trường hợp 2 h&atilde;ng quảng c&aacute;o m&agrave; Spider đ&atilde; n&ecirc;u.&nbsp;<br />\n		<br />\n		Theo điều tra của Microsoft th&igrave; dữ liệu về vị tr&iacute; chuột khi người d&ugrave;ng kh&ocirc;ng d&ugrave;ng tới IE (thu nhỏ tr&igrave;nh duyệt để l&agrave;m c&ocirc;ng việc kh&aacute;c) kh&ocirc;ng g&acirc;y ra nguy hiểm như Spider đ&atilde; n&ecirc;u bởi l&uacute;c n&agrave;y, site tr&ecirc;n IE chỉ c&oacute; thể theo d&otilde;i được vị tr&iacute; con trỏ chứ kh&ocirc;ng ghi lại được c&aacute;c thao t&aacute;c m&agrave; người d&ugrave;ng thực hiện với con chuột của m&igrave;nh</span></span></h1>\n	<p>\n		&nbsp;</p>\n</div>\n<!-- AddThis Button BEGIN --><div class=\"addthis_toolbox addthis_default_style \">\n	  </div>\n<script type=\"text/javascript\">var addthis_config = {\"data_track_addressbar\":true};</script><script type=\"text/javascript\" src=\"//s7.addthis.com/js/300/addthis_widget.js#pubid=ra-5284eb340b7fed5a\"></script><!-- AddThis Button END -->', 'Lỗ hổng trên IE cho phép hacker theo dõi con trỏ chuột của người dùng', 'Lỗ hổng trên IE cho phép hacker theo dõi người dùng');
INSERT INTO mod_news_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (8244, 65, '', 'Hacker tấn công Website thủ tướng Singapore', '<div>\n	<p style=\"text-align: justify;\">\n		Một người đ&agrave;n &ocirc;ng Singapore 35 tuổi đ&atilde; bị ch&iacute;nh quyền bắt giữ do bị nghi ngờ đ&atilde; hack v&agrave;o trang web của Thủ tướng L&yacute; Hiển Long. Trong một cuộc điều tra ri&ecirc;ng biệt, 5 người kh&aacute;c bị nghi ngờ đ&atilde; gi&uacute;p đỡ người n&agrave;y trong loạt tấn c&ocirc;ng v&agrave;o website &quot;đ&igrave;nh đ&aacute;m&quot; gần đ&acirc;y</p>\n	<p style=\"text-align: center;\">\n		<br />\n		<img src=\"http://hdweb.vn/images/news/73637978423421074-hacker-tan-cong-website.jpg\" /><span style=\"color:#f00;\"><br />\n		<br />\n		</span></p>\n	<p style=\"text-align: justify;\">\n		Theo h&atilde;ng tin&nbsp;Reuters, c&aacute;c cuộc tấn c&ocirc;ng số được thực thi bởi những kẻ tự xưng l&agrave; thuộc về &quot;binh đo&agrave;n&quot; hacker lớn nhất thế giới Anynomous, bao gồm cả c&aacute;c trang web ch&iacute;nh thức của Thủ tướng L&yacute; Hiển Long v&agrave; Tổng thống Trần Kh&aacute;nh Vi&ecirc;m (Tony Tan) đ&atilde; l&agrave;m dấy l&ecirc;n những lo ngại về sức mạnh số của Singapore.</p>\n	<p style=\"text-align: justify;\">\n		Một bị c&aacute;o c&oacute; t&ecirc;n James Raj mới đ&acirc;y đ&atilde; bị mang ra x&eacute;t xử với c&aacute;o buộc tấn c&ocirc;ng v&agrave; thay đổi nội dung trang web của hội đồng quản l&yacute; cử tri của Thủ tướng L&yacute; Hiển Long v&agrave;o ng&agrave;y 28/10.</p>\n	<p style=\"text-align: justify;\">\n		Nếu bị kết tội, James Raj c&oacute; thể sẽ phải ngồi t&ugrave; tới 3 năm v&agrave; bị phạt một khoản tiền l&ecirc;n tới 10.000 đ&ocirc; la Singapore (khoảng 170 triệu VND). Theo c&aacute;o buộc m&agrave;&nbsp;Reuters&nbsp;thu được, Raj tiến h&agrave;nh hack m&aacute;y chủ trang web n&oacute;i tr&ecirc;n từ một căn hộ tại Kuala Lumpur, Malaysia.</p>\n	<p style=\"text-align: justify;\">\n		Một c&ocirc;ng tố vi&ecirc;n tuy&ecirc;n bố tại t&ograve;a &aacute;n rằng qu&aacute; tr&igrave;nh điều tra vẫn chưa kết th&uacute;c v&agrave; y&ecirc;u cầu tạm giữ Raj tại Viện Sức khỏe T&acirc;m thần Singapore để đ&aacute;nh gi&aacute; t&igrave;nh trạng sức khỏe t&acirc;m l&yacute;. Vị c&ocirc;ng tố vi&ecirc;n n&agrave;y cho biết Raj đ&atilde; th&ocirc;ng b&aacute;o với cảnh s&aacute;t rằng anh ta bị hội chứng rối loạn khả năng ch&uacute; &yacute; (ADD) v&agrave; c&oacute; xu hướng tự s&aacute;t.</p>\n	<p style=\"text-align: justify;\">\n		Cảnh s&aacute;t từ chối cung cấp c&aacute;c chi tiết về vụ bắt giữ n&agrave;y, song cũng cho biết Raj c&oacute; thể kh&ocirc;ng phải l&agrave; người đ&atilde; tấn c&ocirc;ng b&ocirc;i nhọ trang web của Văn ph&ograve;ng Thủ tướng v&agrave; Phủ Tổng thống Singapore v&agrave;o ng&agrave;y 7 v&agrave; 8/11 vừa qua.</p>\n	<p style=\"text-align: justify;\">\n		Trong tuy&ecirc;n bố ch&iacute;nh thức, cảnh s&aacute;t Singapore cho biết c&aacute;c vụ tấn c&ocirc;ng v&agrave;o ng&agrave;y 7 v&agrave; 8/11 n&agrave;y kh&ocirc;ng li&ecirc;n quan tới một vụ tấn c&ocirc;ng trước đ&oacute; được tiến h&agrave;nh bởi một người đ&agrave;n &ocirc;ng kh&aacute;c 35 tuổi bị bắt giữ v&agrave;o ng&agrave;y 4/11. Tuy kh&ocirc;ng n&ecirc;u r&otilde; t&ecirc;n người n&agrave;y song b&aacute;o giới Singapore phỏng đo&aacute;n đ&oacute; ch&iacute;nh l&agrave; James Raj, do cảnh s&aacute;t Singapore tuy&ecirc;n bố vụ bắt giữ v&agrave;o ng&agrave;y 4/11 được phối hợp chặt chẽ với cảnh s&aacute;t Malaysia.</p>\n	<p style=\"text-align: justify;\">\n		James Raj bị c&aacute;o buộc kh&ocirc;ng chỉ tấn c&ocirc;ng v&agrave;o trang web quản l&yacute; hội đồng cử tri m&agrave; c&ograve;n tấn c&ocirc;ng cả v&agrave;o blog của tờ&nbsp;Straits Times&nbsp;(một tờ b&aacute;o th&acirc;n ch&iacute;nh phủ) v&agrave; một tổ chức kh&aacute;c thuộc về đảng cầm quyền, Đảng H&agrave;nh động Nh&acirc;n d&acirc;n PAP.</p>\n	<p style=\"text-align: justify;\">\n		M. Ravi, luật sư của James Raj v&agrave; cũng l&agrave; một nh&agrave; hoạt động nh&acirc;n quyền, th&ocirc;ng b&aacute;o với c&aacute;c ph&oacute;ng vi&ecirc;n rằng &ocirc;ng kh&ocirc;ng được tiếp x&uacute;c với th&acirc;n chủ của m&igrave;nh v&agrave; do đ&oacute; cũng kh&ocirc;ng thể x&aacute;c nhận liệu Raj c&oacute; phải l&agrave; th&agrave;nh vi&ecirc;n của Anonymous hay kh&ocirc;ng.</p>\n	<p style=\"text-align: justify;\">\n		Trong cuộc điều tra về vụ tấn c&ocirc;ng v&agrave;o trang web của Văn ph&ograve;ng Ch&iacute;nh phủ v&agrave; Phủ Tổng thống, cảnh s&aacute;t đ&atilde; được hỗ trợ bởi 5 người đ&agrave;n &ocirc;ng chưa r&otilde; danh t&iacute;nh, độ tuổi từ 17 đến 45.</p>\n	<p style=\"text-align: justify;\">\n		Cũng trong ng&agrave;y thứ ba 12/11, ch&iacute;nh quyền Singapore đ&atilde; khởi tố 5 người v&igrave; tội ph&aacute; hoại t&agrave;i sản c&ocirc;ng &iacute;ch, khi sơn những d&ograve;ng chữ ủng hộ Anonymous l&ecirc;n tường v&agrave; vỉa h&egrave; đường phố. Theo Luật chống Ph&aacute; hoại của Singapore, những người bị buộc tội n&agrave;y c&oacute; thể phải nộp phạt tối đa 3 năm v&agrave; bị phạt 2.000 đ&ocirc; la Singapore.</p>\n</div>\n', 'Một người đàn ông Singapore 35 tuổi đã bị chính quyền bắt giữ do bị nghi ngờ đã hack vào trang web của Thủ tướng Lý Hiển Long. Trong một cuộc điều tra riêng biệt, 5 người khác bị nghi ngờ đã giúp đỡ người này trong loạt tấn c', 'Một người đàn ông Singapore 35 tuổi đã bị chính quyền bắt giữ do bị nghi ngờ đã hack vào trang web của Thủ tướng Lý Hiển Long. Trong một cuộc điều tra riêng biệt, 5 người khác bị nghi ngờ đã giúp đỡ người này trong loạt tấn c');
