&egrave; c&ograve;n ấm. C&oacute; người c&ograve;n hấp sợi yến với đường ph&egrave;n v&agrave; &iacute;t s&acirc;m hoặc nước dừa.</p>\r\n<p>\r\n	Trong d&acirc;n gian, người ta d&ugrave;ng cả m&aacute;u yến (yến huyết), ph&acirc;n yến (yến thỉ), thịt chim yến (yến nhục) v&agrave; tổ yến trong đ&oacute; c&oacute; x&aacute;c của chim yến non mới nở (s&agrave;o nội yến tử). Ph&acirc;n chim yến 30 g (phơi kh&ocirc;, sao v&agrave;ng, t&aacute;n bột) trộn với tỏi (3 củ) gi&atilde; n&aacute;t, th&ecirc;m hồ l&agrave;m vi&ecirc;n bằng hạt ng&ocirc;. Mỗi lần uống 3 vi&ecirc;n với nước ấm, chữa ngộ độc.</p>\r\n', '<ul>\r\n	<li>\r\n		<strong>Xuất xứ</strong>: Việt Nam</li>\r\n	<li>\r\n		<strong>Độ nguy&ecirc;n chất</strong>: 100%</li>\r\n	<li>\r\n		<strong>HSD</strong>: 20/12/2015</li>\r\n	<li>\r\n		<strong>Nguy&ecirc;n liệu</strong>: 100% Yến tinh chế</li>\r\n	<li>\r\n		<strong>Khối lượng</strong>: 20g</li>\r\n	<li>\r\n		<strong>C&ocirc;ng dụng</strong>: Tốt cho phụ nữ mang thai, phụ nữ l&agrave;m đẹp, trẻ em suy dinh dưỡng, người gi&agrave;, người bệnh.....</li>\r\n</ul>\r\n', '<p>\n	&nbsp;</p>\n<div id=\"cke_pastebin\">\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\">- &Aacute;p dụng cho Dịch vụ thu &acirc;m 1 b&agrave;i đơn ca (bao gồm thu &acirc;m trong 1 giờ, mix, master CD).</span></span></span></p>\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\">- &Aacute;p dụng v&agrave;o tất cả c&aacute;c ng&agrave;y trong tuần.</span></span></span></p>\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\">- Một kh&aacute;ch h&agrave;ng được mua nhiều thẻ.</span></span></span></p>\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\">- Sử dụng 01 phiếu/ người/ bill thanh to&aacute;n (kh&ocirc;ng b&ugrave;).</span></span></span></p>\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\">- Giờ mở cửa: 9h &ndash; 21h.</span></span></span></p>\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\">- Kh&ocirc;ng &aacute;p dụng đồng thời với c&aacute;c chương tr&igrave;nh khuyến m&atilde;i kh&aacute;c.</span></span></span></p>\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\">- Kh&aacute;ch h&agrave;ng vui l&ograve;ng đặt chỗ trước khi đến để được phục vụ tốt nhất.</span></span></span></p>\n	<p style=\"margin: 0px; padding: 2px 0px; color: rgb(51, 51, 51); font-size: 13px; line-height: 16px; font-family: Arial, Tahoma, Helvetica, sans-serif;\">\n		<span style=\"color:#f00;\"><strong><span style=\"font-family: tahoma, geneva, sans-serif; font-size: 14px; line-height: 20px;\">&nbsp;- Giảm 50% cho 50 thẻ đầu ti&ecirc;n đến với c&ocirc;ng ty</span></strong></span></p>\n	<div>\n		<span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 14px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\"><br />\n		</span></span></span></div>\n</div>\n', '', 'ốt cho phụ nữ mang thai, phụ nữ làm đẹp, trẻ em suy dinh dưỡng, người già, người bệnh, một sản phẩm của yến sào Phúc Thịnh');
