INSERT INTO mod_spage_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (1, 1, '', 'Giới thiệu HDweb', '<p>\n	<strong>HDweb</strong> l&agrave; một trong những th&agrave;nh vi&ecirc;n của C&ocirc;ng ty TNHH Quảng C&aacute;o v&agrave; Thương Mại HAPPYCARD. Được th&agrave;nh lập theo Quyết định số 0312237290 do Sở Kế hoạch v&agrave; Đầu tư th&agrave;nh phố Hồ Ch&iacute; Minh cấp. Từ khi th&agrave;nh lập đến nay <strong>HDweb</strong> đ&atilde; c&oacute; những bước ph&aacute;t triển kh&ocirc;ng ngừng tr&ecirc;n nhiều lĩnh vực. Kh&ocirc;ng ngừng mở r&ocirc;ng v&agrave; ph&aacute;t triển gắn kết người ti&ecirc;u d&ugrave;ng với c&aacute;c doanh nghiệp. Quảng b&aacute;, PR&nbsp; thương hiệu, sản phẩm v&agrave; dịch vụ của c&aacute;c doanh nghiệp với mong muốn doanh nghiệp Việt Nam thăng hoa, vươn xa ra thế giới. K&iacute;ch th&iacute;ch ti&ecirc;u d&ugrave;ng trong nước, g&oacute;p phần th&uacute;c đẩy nền kinh tế. Trở th&agrave;nh c&ocirc;ng ty chất lượng h&agrave;ng đầu tại Việt Nam.</p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://hdweb.vn/images/spage/802096082428927187-thiet-ke-web-chuyen-nghiep.jpg\" /></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p>\n	Được th&agrave;nh lập trong bối cảnh ng&agrave;nh c&ocirc;ng nghiệp phần mềm tại Việt Nam bắt đầu ph&aacute;t triển mạnh mẽ, c&ugrave;ng với đ&oacute; l&agrave; xu hướng&nbsp;quảng c&aacute;o trực tuyến&nbsp;đang ng&agrave;y c&agrave;ng được c&aacute;c c&aacute; nh&acirc;n, doanh nghiệp, tổ chức quan t&acirc;m v&agrave; đ&aacute;nh gi&aacute; cao. Ch&iacute;nh v&igrave; vậy sự ph&aacute;t triển của website ng&agrave;y c&agrave;ng c&oacute; t&iacute;nh cạnh tranh cao. L&agrave; một trong những c&ocirc;ng ty đi đầu trong lĩnh vực&nbsp;Thiết Kế Web&nbsp;v&agrave; quảng c&aacute;o trực tuyến. <strong>HDweb</strong> tự h&agrave;o l&agrave; đơn vị mang đến những dịch vụ uy t&iacute;n cho kh&aacute;ch h&agrave;ng. Trải qua qu&aacute; tr&igrave;nh nỗ lực kh&ocirc;ng ngừng, <strong>HDweb</strong> đ&atilde; v&agrave; đang ph&aacute;t triển ng&agrave;y c&agrave;ng lớn mạnh tr&ecirc;n c&aacute;c lĩnh vực mũi nhọn của ng&agrave;nh CNTT như Tư Vấn Giải Ph&aacute;p CNTT, Quảng c&aacute;o, PR thương hiệu v&agrave; đặc biệt l&agrave; lĩnh vực&nbsp;Thiết Kế Website. <strong>HDweb</strong> tự tin với phương ch&acirc;m: niềm vui của bạn l&agrave; th&agrave;nh c&ocirc;ng của ch&uacute;ng t&ocirc;i.</p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://hdweb.vn/images/spage/865405421451170717-thiet-ke-website-chuyen-nghiep-gia-re1.jpg\" /></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p>\n	Với đội ngũ nh&acirc;n vi&ecirc;n l&agrave; c&aacute;c chuy&ecirc;n gia CNTT c&oacute; tr&igrave;nh độ chuy&ecirc;n m&ocirc;n cao v&agrave; sự gi&uacute;p sức của đội ngũ Design v&agrave; kỹ sư trẻ, đầy s&aacute;ng tạo v&agrave; năng động, cộng với niềm niềm đam m&ecirc; với nghề nghiệp, <strong>HDweb</strong> tự h&agrave;o khi mang đến cho kh&aacute;ch h&agrave;ng những website cao cấp với phong c&aacute;ch thiết kế chuy&ecirc;n nghiệp, để lại ấn tượng s&acirc;u sắc trong l&ograve;ng người viếng thăm, qua đ&oacute; n&acirc;ng cao khả năng cạnh tranh cho kh&aacute;ch h&agrave;ng trong lĩnh vực quảng b&aacute; thương hiệu tr&ecirc;n Internet.</p>\n<p>\n	Với những th&agrave;nh c&ocirc;ng m&agrave; ch&uacute;ng t&ocirc;i đ&atilde; đạt được v&agrave; với sự ph&aacute;t triển của c&ocirc;ng ty. Trong tương lai c&ocirc;ng ty ch&uacute;ng t&ocirc;i hy vọng sẽ đem lại cho qu&yacute; kh&aacute;ch h&agrave;ng những lợi &iacute;ch tốt nhất. Đảm bảo hỗ trợ kh&aacute;ch h&agrave;ng kinh doanh hiệu quả dựa v&agrave;o ứng dụng c&ocirc;ng nghệ th&ocirc;ng tin. Đưa c&ocirc;ng ty ng&agrave;y một đi l&ecirc;n</p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://hdweb.vn/images/spage/1075531197422860727-thiet-ke-website-chuyen-nghiep-gia-re3.jpg\" /></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p>\n	<strong>Sứ mệnh của ch&uacute;ng t&ocirc;i</strong></p>\n<p>\n	&ldquo; Sứ mệnh của&nbsp;ch&uacute;ng t&ocirc;i&nbsp;l&agrave; trở th&agrave;nh một c&ocirc;ng ty kinh doanh, thiết kế những dịch vụ phục vụ cho ng&agrave;nh CNTT h&agrave;ng đầu Việt Nam. Phục vụ tốt nhất những kh&aacute;ch h&agrave;ng trong thị trường m&agrave; c&ocirc;ng ty c&oacute; được&rdquo;.</p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://hdweb.vn/images/spage/885491309281048726-thiet-ke-website-chuyen-nghiep-gia-re4.jpg\" /></p>\n<p>\n	<strong><br />\n	Triết l&yacute; của ch&uacute;ng t&ocirc;i</strong></p>\n<p>\n	Kh&aacute;ch h&agrave;ng l&agrave; gi&aacute; trị cơ bản của bất kỳ doanh nghiệp n&agrave;o, l&agrave; l&yacute; do duy nhất để doanh nghiệp tồn tại v&agrave; ph&aacute;t triển. Ch&iacute;nh s&aacute;ch &quot;kh&aacute;ch h&agrave;ng l&agrave; trung t&acirc;m&quot; chỉ lối dẫn đường cho mọi hoạt động của c&ocirc;ng ty.</p>\n<p>\n	Ch&uacute;ng t&ocirc;i lắng nghe, ph&acirc;n t&iacute;ch v&agrave; thấu hiểu nhu cầu của từng kh&aacute;ch h&agrave;ng v&agrave; &aacute;p dụng kinh nghiệm, kỹ năng, tư duy của m&igrave;nh để giải quyết tối ưu những nhu cầu đ&oacute;, gi&uacute;p chủ doanh nghiệp tập trung v&agrave;o c&aacute;c hoạt động kinh doanh cốt l&otilde;i của m&igrave;nh. Mỗi kh&aacute;ch h&agrave;ng l&agrave; một vi&ecirc;n gạch x&acirc;y l&ecirc;n gi&aacute; trị của c&ocirc;ng ty.</p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://hdweb.vn/images/spage/21684681675597556-thiet-ke-website-chuyen-nghiep-gia-re5.jpg\" /></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p>\n	<strong>Định hướng ph&aacute;t triển của c&ocirc;ng ty</strong></p>\n<p>\n	- Giữ vững v&agrave; ng&agrave;y c&agrave;ng tăng tốc độ ph&aacute;t triển tr&ecirc;n mọi chỉ ti&ecirc;u doanh số, thị phần, nh&acirc;n lực, gi&aacute; trị thương hiệu, số lượng sản phẩm (thiết kế website, quảng c&aacute;o trực tuyến, phần mềm v&agrave; c&aacute;c sản phẩm trong ngh&agrave;nh CNTT ...)<br />\n	<br />\n	- Ph&aacute;t huy v&agrave; n&acirc;ng cao thế mạnh sẵn c&oacute; của c&ocirc;ng ty về quản l&yacute;, sản xuất, mua b&aacute;n, gia c&ocirc;ng, thiết kế website v&agrave; ph&aacute;t triển phần mềm, Giải ph&aacute;p mạng,&hellip;l&ecirc;n một tầm cao mới để đ&aacute;p ứng với những nhu cầu ng&agrave;y c&agrave;ng cao của kh&aacute;ch h&agrave;ng cũng như để sẵn s&agrave;ng trong việc c&ugrave;ng đất nước hội nhập WTO.</p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<img src=\"http://hdweb.vn/images/spage/614843718892888776-thiet-ke-website-chuyen-nghiep-gia-re2.jpg\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	Với mong muốn được phục vụ c&aacute;c kh&aacute;ch h&agrave;ng v&agrave; doanh nghiệp ng&agrave;y c&agrave;ng chu đ&aacute;o hơn, ch&uacute;ng t&ocirc;i lu&ocirc;n sẵn s&agrave;ng tiếp nhận v&agrave; biết ơn mọi sự g&oacute;p &yacute; của tất cả qu&yacute; vị.</p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: right;\">\n	<em><strong>C&ugrave;ng nhau ph&aacute;t triển - C&ugrave;ng Nhau th&agrave;nh c&ocirc;ng!</strong></em><br />\n	<strong>Ban điều h&agrave;nh HDweb<br />\n	</strong></p>\n', 'HDweb - Niềm vui cho mọi nhà', 'HDweb - Niềm vui cho mọi nhà');
