INSERT INTO mod_spage_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (6, 6, '', 'Liên hệ', '<h2>\n	<strong>Văn ph&ograve;ng giao dịch HDweb</strong></h2>\n<p>\n	<span style=\"font-size:14px;\">Trụ sở: Lầu 1, 387 Lạc Long Qu&acirc;n, P.5, Quận 11, Tp. HCM.</span></p>\n<p>\n	<span style=\"font-size:14px;\">Điện thoại: (08) 6264.1973 / 0903.159.246 / 01.655.177.655<br />\n	</span></p>\n<p>\n	<span style=\"font-size:14px;\">Email: <a href=\"mailto:happycard.vn@gmail.com\">hdweb.vn@gmail.com</a></span></p>\n<p>\n	<span style=\"font-size:14px;\">Website: <a href=\"http://hdweb.vn\">http://hdweb.vn/<br />\n	</a></span></p>\n<p>\n	<a href=\"http://hdweb.vn\"><br />\n	</a></p>\n<h2>\n	<img border=\"0\" src=\"http://happycard.vn/images/spage/1595483884-lien-he-happycard.png\" style=\"font-size: 12px;\" /></h2>\n', 'thietkeweb, thiet, ke,web', 'HDweb - Cam kết hiệu quả cao nhất');
INSERT INTO mod_spage_lang (`ID`, `FID`, `lang`, `tieu_de`, `noi_dung`, `keywords`, `description`) VALUES (20, 20, '', 'Khuyến mãi', '<ul>\n	<li style=\"text-align: justify;\">\n		<strong>Giảm 10%&nbsp; t&ecirc;n miền quốc tế (.com,.net,.org...)</strong></li>\n	<li style=\"text-align: justify;\">\n		<strong>Giảm 10% hosting chất lượng cao</strong></li>\n	<li style=\"text-align: justify;\">\n		<strong>Giảm 10% Ph&iacute; thiết kế website</strong></li>\n	<li style=\"text-align: justify;\">\n		Miễn ph&iacute; đăng th&ocirc;ng tin tr&ecirc;n website: <a href=\"http://thuonghieuvn.net\">http://thuonghieuvn.net/</a> - Trang v&agrave;ng danh bạ doanh nghiệp</li>\n	<li style=\"text-align: justify;\">\n		Module website: Trang chủ - Giới thiệu - Tin tức - Sản phẩm - Video clip - H&igrave;nh ảnh - Li&ecirc;n hệ...v&agrave; 1 số chức năng kh&aacute;c theo y&ecirc;u cầu của qu&yacute; kh&aacute;ch (Giao diện website ch&uacute;ng t&ocirc;i sẽ thiết kế theo y&ecirc;u cầu chi tiết của qu&yacute; kh&aacute;ch.)</li>\n</ul>\n<p style=\"text-align: center;\">\n	<img src=\"http://hdweb.vn/images/spage/1039143457041838525-khuyen-mai-thiet-ke-thang-11.png\" /></p>\n<p>\n	<strong>Với mục ti&ecirc;u mang đến cho kh&aacute;ch h&agrave;ng một giải ph&aacute;p kinh doanh trực tuyến hiệu quả v&agrave; tiết kiệm chi ph&iacute;. Những website do HDweb thiết kế lu&ocirc;n đảm bảo c&aacute;c ti&ecirc;u ch&iacute; sau:</strong><span style=\"font-size:18px;\"><br />\n	</span></p>\n<ul>\n	<li>\n		Tư vấn thiết kế gi&uacute;p qu&yacute; kh&aacute;ch c&oacute; được giao diện sang trọng v&agrave; ph&ugrave; hợp với ng&agrave;nh nghề kinh doanh của qu&yacute; kh&aacute;ch.</li>\n	<li>\n		Hệ thống quản l&yacute; website chuy&ecirc;n nghiệp v&agrave; tư vấn nhập liệu để mang lại hiệu quả cao nhất.</li>\n	<li>\n		Tối ưu h&oacute;a c&aacute;c c&ocirc;ng cụ t&igrave;m kiếm (SEO) gi&uacute;p website chạy nhanh, th&acirc;n thiện hơn với Google g&oacute;p phần nhanh ch&oacute;ng mang sản phẩm dịch vụ v&agrave; quảng b&aacute; thương hiệu của qu&yacute; kh&aacute;ch một c&aacute;ch nhanh nhất.</li>\n	<li>\n		&Aacute;p dụng c&aacute;c c&ocirc;ng nghệ kỹ thuật mới nhất của Microsoft v&agrave; một số thủ thuật mới g&oacute;p phần gi&uacute;p website th&acirc;n thiện v&agrave; dễ sử dụng (Sử dụng c&ocirc;ng nghệ PHP + MSSQLSERVER + JQUERY + JAVA + FLASH...)</li>\n	<li>\n		Tư vấn quảng c&aacute;o v&agrave; đẩy mạnh thương hiệu của qu&yacute; kh&aacute;ch tr&ecirc;n Internet&nbsp;Facebook, Twitter, Myspace,&nbsp;c&aacute;c trang rao vặt</li>\n	<li>\n		Chế độ bảo h&agrave;nh v&agrave; hỗ trợ m&atilde;i m&atilde;i.</li>\n</ul>\n<div>\n	<strong>H&atilde;y li&ecirc;n hệ ngay với ch&uacute;ng t&ocirc;i, qu&yacute; kh&aacute;ch sẽ c&oacute; chiến lược ph&aacute;t triển maketing online ho&agrave;n to&agrave;n hợp l&yacute;.<br />\n	</strong></div>\n', 'khuyến mãi tại HDweb', 'khuyến mãi tại HDweb');
